INSERT INTO `company` VALUES (80001,'yen','new services',124567890.10,'3900-12-21','LeapByCodes',5000,'240-239-2332',NULL,124567890.10,'254-345-3454','https://www.leapbycodes.com',2019),(80002,NULL,'3 Round Stones produces a platform for publishing data on the Web. 3 Round Stones provides commercial support for the Callimachus Data Platform, used by the Fortune 2000 and US Government Agencies publishing and consuming data.  Headquartered in Arlington, Virginia, were seasoned entrepreneurs who are passionate about solving real world problems through open data and open Web standards.',NULL,'3900-12-21','3 Round Stones, Inc.',0,NULL,NULL,NULL,NULL,'http://3RoundStones.com',2010),(80003,NULL,'The company mission is to provide finance to small business. We also provide financing to small business with bad credit too on the basis of future credit.',NULL,'3900-12-21','48 Factoring Inc.',0,NULL,NULL,NULL,NULL,'https://www.48factoring.com',2014),(80004,NULL,'At 5PSolutions, we wish to make all basic information of different categories easily available to via tablets or phones.',NULL,'3900-12-21','5PSolutions',0,NULL,NULL,NULL,NULL,'www.5psolutions.com',2007),(80005,NULL,'Abt Associates is a mission-driven, international company conducting research and program implementation in the fields of health, social and environmental policy, and international development. The company has multiple offices in the U.S. and program offices in more than 40 countries.',NULL,'3900-12-21','Abt Associates',0,NULL,NULL,NULL,NULL,'abtassoc.com',1965),(80006,NULL,'Accela powers thousands of services and millions of transactions for more than 500 public agencies worldwide, enabling governments to connect with citizens and streamline processes related to land management, asset management, licensing, and public health & safety. Accela addresses a broad range of agency, business and citizen needs, and includes built-in payment, scheduling, compliance and information transparency. Together with our partners, Accela can custom-tailor solutions based on precise agency specifications, or deploy packaged solutions based on best practice templates and pre-defined services in a matter of a few weeks.',NULL,'3900-12-21','Accela',0,NULL,NULL,NULL,NULL,'http://www.accela.com',1999),(80007,NULL,'Accenture delivers its services and solutions through 19 focused industry groups in five operating groups. This industry focus provides Accenture’s professionals with a thorough understanding of industry evolution, business issues and applicable technologies, enabling Accenture to deliver solutions tailored to each clients industry.',NULL,'3900-12-21','Accenture',0,NULL,NULL,NULL,NULL,'http://www.accenture.com/us-en/pages/index.aspx',1989),(80008,NULL,'AccuWeather provides local forecasts for everywhere in the United States and over two million locations worldwide. AccuWeather also provides our products and services to more than 175,000 paying customers in media, business, government and institutions. Our headquarters in State College, PA, is home to the greatest number of forecast meteorologists in one location anywhere in the world.',NULL,'3900-12-21','AccuWeather',0,NULL,NULL,NULL,NULL,'http://www.accuweather.com',1962),(80009,NULL,'Acxiom is an enterprise data, analytics and software as a service company. For more than 40 years, Acxiom has harnessed the powerful potential of data to strengthen connections between people, businesses and their partners.',NULL,'3900-12-21','Acxiom',0,NULL,NULL,NULL,NULL,'http://acxiom.com',1969),(80010,NULL,'Adaptive offers standards-based solutions that help organizations better align their valuable information by supporting specific management challenges including Data Governance, Data Quality, Metadata Management, Enterprise Architecture Management and IT Portfolio Management.',NULL,'3900-12-21','Adaptive',0,NULL,NULL,NULL,NULL,'http://www.adaptive.com',2001),(80011,NULL,'Adobe Digital Government is part of Adobe Systems, a global digital marketing and digital media solutions company. Adobes tools and services allow customers to create digital content, deploy it across media and devices, measure and optimize it over time. \n\nAdobe Digital Government delivers solutions that help government agencies make, manage, mobilize, and measure the information and experiences needed to achieve their missions. Adobe Digital Government provides solutions for content creation and management, more secure business workflows, easy-to-develop forms, robust analytics, or intuitive collaboration and eLearning.',NULL,'3900-12-21','Adobe Digital Government',0,NULL,NULL,NULL,NULL,'http://www.adobe.com/solutions/government.html',2009),(80012,NULL,'Aidin helps hospitals and their patients choose the highest quality post-acute care available to them. By streamlining hospital staffs search process for available post-acute care and tracking and sharing with patients how well providers have performed with similar patients in the past, Aidin helps hospitals reduce length of stay and prevent costly and dangerous readmissions from post-acute care.',NULL,'3900-12-21','Aidin',0,NULL,NULL,NULL,NULL,'http://www.myAidin.com',2011),(80013,NULL,'Alarm.com is a technology provider of connected home services, powering well over one million residential and commercial installations. Through its connected home platform, millions of people use Alarm.com to help protect and manage the things that matter most – their homes, families, and small businesses. Alarm.com connects a wide range of supported devices across the internet of things to provide an integrated connected home experience through an intelligent cloud-based services platform and easy to use mobile app. Alarm.com solutions are sold exclusively through a network of licensed and authorized Dealer Partners.',NULL,'3900-12-21','Alarm.com',0,NULL,NULL,NULL,NULL,'www.alarm.com',2000),(80014,NULL,'Allianz Life Insurance Company is a provider of retirement solutions, including fixed and variable annuities and life insurance for individuals.',NULL,'3900-12-21','Allianz',0,NULL,NULL,NULL,NULL,'http://www.allianzusa.com',1896),(80015,NULL,'Allied Van Lines is a global relocation company, serving individuals and corporations all over the world for their transportation and storage needs.',NULL,'3900-12-21','Allied Van Lines',0,NULL,NULL,NULL,NULL,'http://www.allied.com',1928),(80016,NULL,'The Allstate Corporation is a holding company for Allstate Insurance Company. The company’s business is conducted principally through Allstate Insurance Company, Allstate Life Insurance Company and their affiliates. It is engaged, principally in the United States, in the property-liability insurance, life insurance, retirement and investment product business. \n\nAllstates primary business is the sale of private passenger auto and homeowners insurance. The Company also sells several other personal property and casualty insurance products, select commercial property and casualty coverages, life insurance, annuities, voluntary accident and health insurance and funding agreements. Allstate primarily distributes its products through exclusive agencies, financial specialists. Allstate has four business segments: Allstate Protection, Allstate Financial, Discontinued Lines and Coverages and Corporate and Other. The Company is a personal lines insurer in the United States.',NULL,'3900-12-21','AllState Insurance Group',0,NULL,NULL,NULL,NULL,'http://www.allstate.com',1931),(80017,NULL,'Alltuition.com makes sure you don’t miss out on financial aid. Based on the colleges where youre applying for aid, we instantly match you to your opportunities and help you maximize your chances for aid.',NULL,'3900-12-21','Alltuition',0,NULL,NULL,NULL,NULL,'https://www.alltuition.com',2009),(80018,NULL,'At Altova, our mission is to deliver standards-based, platform-independent software development tools that empower our customers to create, access, edit and transform information resources. Altova is the c