.',NULL,'3900-12-21','Arpin Van Lines',0,NULL,NULL,NULL,NULL,'http://www.arpin.com',1900),(80029,NULL,'Arrive Labs builds software solutions for urban transit solutions, that currently has created two apps - Arrive and TransitHero. Arrive is a multi-modal urban transit app for San Francisco providing information across all available modalities like train, bus, taxis, SideCar, ZipCar and our friends, Scoot Networks. \n\nTransitHero, an app for the San Francisco Bay Area, delivers live real-time transit information for BART, MUNI, and AC Transit. It combines live, crowd sourced reports from our community of users, as well as our proprietary data set to give you intelligence on public transit in the city. You can become a TransitHero by reporting anything from a delay to a crowded train, rescuing transit riders from bad transit experiences before they get stuck.',NULL,'3900-12-21','Arrive Labs',0,NULL,NULL,NULL,NULL,'http://home.downloadarrive.com',2011),(80030,NULL,'ASC Partners offers business financial applications specific to small-to-medium size organizations in various industries. We provide extensive experience in technologies involving business process analyses, back office accounting systems, business applications, software integration, and analytical solutions. We design cost-effective plans for customers to achieve ongoing productivity.',NULL,'3900-12-21','ASC Partners',0,NULL,NULL,NULL,NULL,'http://www.asc-partners.com',2010),(80031,NULL,'ASSET4 AG provides investment research information on economic, environmental, social, and governance (ESG) aspects of corporate performance. The company provides a database containing ESG information of publicly listed companies, countries, local authorities, state-owned companies, and supranational entities in a Web based architecture. It also provides equity-focused solutions and fixed income solutions for professional investors and corporate executives; extra-financial information for fixed income investments; and carbon data and estimates.',NULL,'3900-12-21','Asset4',0,NULL,NULL,NULL,NULL,'asset4.com',2003),(80032,NULL,'Atlas Van Lines is a subsidiary of Atlas World Group, a family of companies headquartered in Evansville, Indiana. Atlas serves markets for global relocation, benefits, recruiting, logistics and travel, through a network of more than 500 Atlas Agents in the United States and Canada, and service partners operating in 140 countries around the world. A commitment to integrity, quality and solutions still guides the company, just as Atlas Agent-owners still set the policies that further service excellence.',NULL,'3900-12-21','Atlas Van Lines',0,NULL,NULL,NULL,NULL,'http://www.atlasvanlines.com',1948),(80033,NULL,'AtSites open-source technology and building performance solutions help organizations maximize the strategic value and long-term performance of real estate assets. Our experts enable executives and building management teams to reduce costs, mitigate risk and scale for greater efficiency.',NULL,'3900-12-21','AtSite',0,NULL,NULL,NULL,NULL,'www.atsiteinc.com',1993),(80034,NULL,'At Aunt Bertha, Inc., we collect all federal, state, county, city, neighborhood, and charity program information and put it in one place. If its based on need, then we collect it. Using information we learn about programs, and what we learn from the user, we intelligently match people with services that are designed specifically for their situation.',NULL,'3900-12-21','Aunt Bertha, Inc.',0,NULL,NULL,NULL,NULL,'auntbertha.com',2010),(80035,NULL,'Aureus Science provides Knowledge Management Systems that are uniquely designed for drug discovery research. Aureus delivers life sciences information solutions that integrate structured knowledge databases with powerful search and insight applications to turn Turn Data into Discovery. \n\nAureus Science was acquired by Elsevier in January 2013. Elsevier is a provider of information solutions that enhance the performance of science, health, and technology professionals, empowering them to make better decisions, deliver better care, and sometimes make groundbreaking discoveries. Elsevier provides web-based, digital solutions — among them ScienceDirect, Scopus, Elsevier Research Intelligence, and ClinicalKey —  and publishes nearly 2,200 journals, including The Lancet and Cell, and over 25,000 book titles, including a number of iconic reference works.\n\nThe company is part of Reed Elsevier Group PLC, a world leading provider of professional information solutions in the Science, Medical, Legal and Risk and Business sectors',NULL,'3900-12-21','Aureus Sciences (*Now part of Elsevier)',0,NULL,NULL,NULL,NULL,'http://www.aureus-sciences.com',2000),(80036,NULL,'AutoGrid Systems is organizing the worlds energy data by bringing Internet scale cloud-computing to process and analyze the petabytes of energy data produced from an increasingly networked and automated grid. AutoGrid then employs big data analytics to generate real-time predictions that creates actionable data for electricity generators, providers, grid operators, and their customers to improve the utilization of the grid and manage the cost to serve.',NULL,'3900-12-21','AutoGrid Systems',0,NULL,NULL,NULL,NULL,'http://www.auto-grid.com',2011),(80037,NULL,'Avalara has created a web-based platform that provides a complete package of automated end to end compliance services. Avalara works within your own financial, billing, ecommerce, or point of sale system to automate sales and use tax and compliance. Once configured, you never again worry about ever-changing, impenetrable rates, rules, boundaries, exemptions, tax holidays, reporting requirements, filing deadlines, etc. Avalara combines technology with available statutory content to deliver fully automated sales tax compliance solutions.',NULL,'3900-12-21','Avalara',0,NULL,NULL,NULL,NULL,'http://www.avalara.com',2004),(80038,NULL,'Avvo.com is a legal marketplace for consumers and attorneys. In Avvos Q&A forum, 