ess the data from one trusted source.',NULL,'3900-12-21','BizVizz',0,NULL,NULL,NULL,NULL,'http://bizvizz.com',2011),(80052,NULL,'BlackRock offers mutual funds, closed-end funds, managed accounts and alternative investments to individuals, institutions and financial professionals. Our mission is to create a better financial future for our clients.',NULL,'3900-12-21','BlackRock',0,NULL,NULL,NULL,NULL,'http://www.blackrock.com',1988),(80053,NULL,'Bloomberg, a global business and financial information and news provider, gives influential decision-makers a critical edge by connecting them to a dynamic network of information, people and ideas. \n\nThe company delivers data, news and analytics through innovative technology, quickly and accurately. This is at the core of the Bloomberg Professional service, which provides real time financial information to subscribers globally. \n\nBloomberg’s enterprise solutions leverages technology to allow customers to access, integrate, distribute and manage data and information across organizations more efficiently and effectively. \n\nBloomberg News, delivered through the Bloomberg Professional service, television, radio, mobile, the Internet and two magazines, Bloomberg Businessweek and Bloomberg Markets, covers the world with more than 2,430 news and multimedia professionals at 146 bureaus in 72 countries.',NULL,'3900-12-21','Bloomberg',0,NULL,NULL,NULL,NULL,'http://www.bloomberg.com',1982),(80054,NULL,'Booz Allen Hamilton is a strategic management and technology consulting firm offering a full range of consulting services to senior management in industry and government. Our approach to management and technology consulting combines domain expertise with strong capabilities in strategy, and organization, analytics, technology and operations. \n\nWe work with leading organizations focused on improving and advancing our government. Together, we conduct studies, convene experts and stakeholders, and publish reports to proffer ideas that