ion, research and information services companies. Our investments have largely focused on businesses in the information services and education industry broadly defined. Generally, our investments either support an existing business or launch a new platform. Our primary goal is to expand and grow existing operating companies through strategic acquisitions. CIG concentrates on businesses of any size, location, and technology structure that can leverage our existing platforms.',NULL,'3900-12-21','Cambridge Information Group',0,NULL,NULL,NULL,NULL,'http://www.cig.com',1971),(80066,NULL,'Cambridge Semantics provides the Anzo software suite, an open platform for building interactive Unified Information Access solutions and using data from diverse sources. Anzo allows both IT and end users to deal with the increasing need to rapidly discover, understand, combine, and act on data from diverse sources both from within and across organizational boundaries, by rapidly creating solutions that leverage unified access to structured and unstructured data.',NULL,'3900-12-21','Cambridge Semantics',0,NULL,NULL,NULL,NULL,'http://www.cambridgesemantics.com/home',2007),(80067,NULL,'CAN Capital (formerly Capital Access Network) is a large, experienced company providing small businesses with access to alternative capital. CAN Capital uses innovative and proprietary risk models combined with daily performance data to evaluate business performance. Its business evaluation model allows it to facilitate capital for entrepreneurs and help them qualify for more money than they could obtain elsewhere. Small businesses in over 650 industries have chosen CAN Capital to obtain easy access to the funding that they need. \n\nCAN Capital makes capital available to businesses through its subsidiaries: Merchant Cash Advances by CAN Capital Merchant Services, Inc., and business loans through CAN Capital Asset Servicing, Inc. (CCAS). All business loans obtained through CCAS are made by WebBank, a Utah-chartered Industrial Bank, member FDIC.',NULL,'3900-12-21','CAN Capital',0,NULL,NULL,NULL,NULL,'http://www.cancapital.com/',1998),(80068,NULL,'Canon is a Japanese multinational corporation specialized in the manufacture of imaging and optical products, including cameras, camcorders, photocopiers, steppers, computer printers and medical equipment. \n\nCanon scanners offer high-performance features that make converting paper documents easier, such as high-speed precision feeding technology, compact design, high-speed color capability and even flexible configuration options. Canon is working with Captricity to transform government data into a form whereby it can be tagged, shared, secured and mashed up.',NULL,'3900-12-21','Canon',0,NULL,NULL,NULL,NULL,'http://www.canon.com',1937),(80069,NULL,'Capital Cube provides company analysis including on-demand fundamental research, portfolio evaluation, and screening tools on over 40000 global equities and ETFs. The web portal empowers your investment ideas through in-depth analysis on a company’s (a) performance relative to its peers, (b) accounting and earnings quality, (c) dividend strength, and (d) likely corporate actions such as dividend changes, share buybacks, and acquisitions. Our stock screener allows you to identify investment ideas using natural business terms and by investing themes e.g. companies likely to increase dividends or those with earnings quality issues. The ETF Analysis tool provides detailed fundamental analysis of ETFs by each risk component.',NULL,'3900-12-21','Capital Cube',0,NULL,NULL,NULL,NULL,'http://www.capitalcube.com',2010),(80070,NULL,'Cappex offers several solutions to colleges and universities that allow them to reach and connect with students in Cappex communities, and help them yield more enrollments by staying engaged with their applicants. We also help higher education institutions and foundations simplify their scholarship process so they can maximize the impact of the scholarships they award.',NULL,'3900-12-21','Cappex',0,NULL,NULL,NULL,NULL,'www.cappex.com',2006),(80071,NULL,'Captricity transforms static documents, including handwriting on paper, into actionable data. Our solution is fast, vastly scalable, highly secure and 99%+ accurate. Our mission is to unlock the data that drives the world forward.  For everyone.',NULL,'3900-12-21','Captricity',0,NULL,NULL,NULL,NULL,'captricity.com',2011),(80072,NULL,'CareSet is a growing group of idea people servicing ACOs, IPAs, and hospitals across the country.  As a sister company to The DocGraph Journal, CareSet responds to many needs across the healthcare spectrum, providing multi-level insights via an innovative data analytics platform, custom reporting, ETL processing, and data mapping.',NULL,'3900-12-21','CareSet Systems',0,NULL,NULL,NULL,NULL,'www.careset.com',2013),(80073,NULL,'CareSet is a growing group of idea people servicing ACOs, IPAs, and hospitals across the country.  As a sister company to The DocGraph Journal, CareSet responds to many needs across the healthcare spectrum, providing multi-level insights via an innovative data analytics platform, custom reporting, ETL processing, and data mapping. \n\n\n\n',NULL,'3900-12-21','Careset.com',0,NULL,NULL,NULL,NULL,'www.careset.com',2013),(80074,NULL,'CARFAX was started to provide vehicle history information on used cars. CARFAX provides vehicle history information to millions of consumers each year. CARFAX Vehicle History Reports are available on all used cars and light trucks model year 1981 or later. Using the unique 17-character vehicle identification number (VIN), a CARFAX Report is instantly generated from our database of over six billion records.',NULL,'3900-12-21','CARFAX',0,NULL,NULL,NULL,NULL,'http://www.carfax.com',1984),(80075,NULL,'Caspio’s on-demand cloud-based database platform replaces coding with intuitive point-and-click wizards, enabling users to rapidly produce web database components for capturing, publishing and managing data online.',NULL,'3900-12-21','Caspio',0,NULL,NULL,NULL,NULL,'http://www.caspio.com/',2000),(80076,NULL,'Castle Biosciences, Inc. specializes in diagnostic tests for cancers. The company goal is to help advance the care for cancers through objective testing. Our team works with members of the oncology community throughout the discovery, development and utilization of these tests.',NULL,'3900-12-21','Castle Biosciences',0,NULL,NULL,NULL,NULL,'http://www.castlebiosciences.com',2008),(80077,NULL,'CB Insights takes immense amounts of data about private companies, their investors, their acquirers and the emerging industries they compete in to provide forward-looking intelligence on the health of companies, investors, industries and competitor strategy.',NULL,'3900-12-21','CB Insights',0,NULL,NULL,NULL,NULL,'http://www.cbinsights.com/',2009),(80078,NULL,'Ceiba is a products and service company dedicated to unleashing the value of life science and healthcare data while reducing the cost to manage it.',NULL,'3900-12-21','Ceiba Solutions',0,NULL,NULL,NULL,NULL,'http://www.ceibasolutions.com',2006),(80079,NULL,'As a nonpartisan, independent and nonprofit organisation, the Center for Responsive Politics aims to create a more educated voter, an involved citizenry and a more responsive government.',NULL,'3900-12-21','Center for Responsive Politics',0,NULL,NULL,NULL,NULL,'www.opensecrets.org',1983),(80080,NULL,'Cerner is a major U.S. supplier of health care information technology solutions that optimize clinical and financial outcomes. Cerner offers clients a dedicated focus on health care, an end-to-end solution and service portfolio, and proven market leadership.',NULL,'3900-12-21','Cerner',0,NULL,NULL,NULL,NULL,'http://www.cerner.com',1979),(80081,NULL,'Certara provides guidance spanning drug discovery and development – with modeling, analysis, and simulation methods that include molecular modeling, PK/PD modeling and simulation, PBPK modeling and simulation, prediction of drug-drug interactions, and clinical trial simulation. With these capabilities, Certara is able to help our customers accelerate decision making, and enable the cross-disciplinary approaches necessary for translational science. \n\nCertara also offers software and scientific consulting services in the areas of pharmacometrics, PK/PD analysis, biostatistics, medical writing, and PBPK modeling and simulation. It serves pharmaceutical and biotechnology customers and users. The company was founded in 2008 and is based in St. Louis, Missouri with additional offices in California, North Carolina, France, Germany, the United Kingdom, China, India, and Japan.',NULL,'3900-12-21','Certara',0,NULL,NULL,NULL,NULL,'http://www.certara.com',2008),(80082,NULL,'CGI provides end-to-end IT and business process services that facilitate the ongoing evolution of our clients businesses. The company provides business process outsourcing (BPO), systems integration and consulting. It has particular expertise in cloud computing, health information exchanges, cybersecurity, and biometrics. CGIs end-to-end services are targeted at several select verticals: financial services; telecommunications and utilities; manufacturing, retail, and distribution; health; and government, which is its largest client market.',NULL,'3900-12-21','CGI',0,NULL,NULL,NULL,NULL,'http://www.cgi.com/en',1976),(80083,NULL,'Charles River Associates is a global consulting firm that offers economic, financial, and strategy expertise to major law firms, corporations, accounting firms, and governments around the world. We offer litigation and regulatory support, business strategy and planning, market and demand forecasting, policy analysis, and risk management consulting.',NULL,'3900-12-21','Charles River Associates',0,NULL,NULL,NULL,NULL,'http://crai.com/',1965),(80084,NULL,'The Charles Schwab Corporation is a savings and loan holding company. The company, through its subsidiaries, is engaged in securities brokerage, banking, and related financial services. It provides financial services to individuals and institutional clients through two segments: Investor Services and Institutional Services.',NULL,'3900-12-21','Charles Schwab Corp.',0,NULL,NULL,NULL,NULL,'https://www.schwab.com',1973),(80085,NULL,'CAS originated in 1907 when the American Chemical Society launched Chemical Abstracts to keep scientists in touch with new chemical information worldwide. To continue fulfilling this mission as publicly disclosed chemical information grew exponentially, CAS adapted computerisation to speed editorial processing in the 1960s. This led to the creation of the CAS Chemical Registry System, CAS databases, and a range of electronic information services, which now account for 96 per cent of CAS’ business. \n\nCAS offers a large and comprehensive database of disclosed chemical substances, the CAS Registry, with 33 million records for organic and inorganic chemicals.',NULL,'3900-12-21','Chemical Abstracts Service',0,NULL,NULL,NULL,NULL,'https://www.cas.org',1907),(80086,NULL,'ChildCareDesk is a cloud-based Software Platform that aims to help parents find quality child care near them, and help child care centers build an online presence that in turn would help them grow their business and reach out to more parents. ChildCareDesk also helps government agencies, non-profit organizations and investors with data points they may use to invest in child care and make more options available for parents.',NULL,'3900-12-21','Child Care Desk',0,NULL,NULL,NULL,NULL,'http://childcaredesk.com',2013),(80087,NULL,'The Chubb Corporation, through its subsidiaries, provides property and casualty insurance to businesses and individuals. The company distributes its products through independent insurance agents and insurance brokers in the United States, Canada, Europe, Australia, Latin America, and Asia.',NULL,'3900-12-21','Chubb',0,NULL,NULL,NULL,NULL,'http://www.chubb.com',1882),(80088,NULL,'Citigroup Inc., a diversified financial services holding company, provides various financial products and services to consumers, corporations, governments, and institutions. \n\nThe companys Global Consumer Banking segment provides various banking, credit card lending, and investment services through a network of local branches, offices, and electronic delivery systems. The companys Institutional Clients Group segment provides a range of banking, and financial products and services to corporate, institutional, public sector, and high-net-worth clients. ',NULL,'3900-12-21','Citigroup',0,NULL,NULL,NULL,NULL,'http://www.citigroup.com/citi/',1812),(80089,NULL,'CityScan, a Chicago venture-backed software company, is a leader in the field of intelligent data collection and integration for Smart Cities and Utilities. Our patented process integrates private and municipal data with the most advanced 3D visual data collection methods available, resulting in improved efficiency operations while reducing overall costs. Our technology provides clients a solution to manage their assets, ensure businesses are operating within local ordinances and provide a safe environment for their residents.',NULL,'3900-12-21','CityScan',0,NULL,NULL,NULL,NULL,'www.CityScan.com',2011),(80090,NULL,'CitySourced is a major enterprise civic engagement platform, covering over 25 million residents worldwide. CitySourced empowers organizations by allowing residents to report back problems in their communities directly using our simple, free smartphone application. Our service leads municipalities to greater efficiencies, to be more responsive, and to accomplish more with fewer resources.',NULL,'3900-12-21','CitySourced',0,NULL,NULL,NULL,NULL,'http://www.citysourced.com/',2007),(80091,NULL,'GovTrack.us, the main project of Civic Impulse LLC, is a government transparency website. The site helps ordinary citizens find and track bills in the U.S. Congress and understand their representatives legislative record.\n\nIn 2012, GovTrack.us was used by more than 5 million individuals. Its embeddable widgets were deployed on more than 70 official websites of Members of Congress. GovTrack also openly shares the data it brings together so that other websites can build other tools to help citizens engage with government.',NULL,'3900-12-21','Civic Impulse LLC',0,NULL,NULL,NULL,NULL,'https://www.govtrack.us/civicimpulse',2009),(80092,NULL,'Civic Insight turns buried property data critical to the development of cities into actionable information. While knowledge of city codes and permits is required for construction, development, and revitalization, too often the status of the work is opaque. This slows down projects and is costly for everyone involved. Civic Insight makes it easy to quickly access up-to-date information in ways that are easy to understand and use.',NULL,'3900-12-21','Civic Insight',0,NULL,NULL,NULL,NULL,'http://civicinsight.com',2012),(80093,NULL,'Civinomics mission is to improve civic decision-making through the collective creativity of communities. Our platform provides a one-stop-shop civic portal where people can engage in the issues they care about. They can also find the resources needed to make more educated decisions and find better solutions. Our platform provides a place for people to vote on ideas, discuss topics and ask questions, and share the relevant information needed to address an issue. It also closes the civic loop by allowing users to send these ideas directly to their leaders, and raise the necessary funds for implementation.',NULL,'3900-12-21','Civinomics',0,NULL,NULL,NULL,NULL,'civinomics.com',2011),(80094,NULL,'Civis Analytics is a Big Data analytics firm based in Chicago, IL and Washington, DC. We help companies, non-profits, and campaigns leverage their data to develop smarter strategy, make better decisions, and build stronger, data-driven organizations.',NULL,'3900-12-21','Civis Analytics',0,NULL,NULL,NULL,NULL,'http://civisanalytics.com/',2013),(80095,NULL,'Clean Power Finance is a financial technology company whose mission is to drive the mass adoption of residential solar. It connects institutional investors looking for attractive managed-risk assets with solar professionals who sell solar finance products that help US consumers afford clean solar energy.',NULL,'3900-12-21','Clean Power Finance',0,NULL,NULL,NULL,NULL,'http://www.cleanpowerfinance.com',2006),(80096,NULL,'Were bringing transparency to the health-care marketplace by telling people what stuff costs. \n\nWere journalists, and we believe that transparent marketplaces benefit consumers. We also think people should be able to know what things cost.',NULL,'3900-12-21','ClearHealthCosts',0,NULL,NULL,NULL,NULL,'clearhealthcosts.com',2011),(80097,NULL,'ClearStory Data is making it easy for business users to find, combine and interactively explore big, diverse data across first-party and third-party sources for immediate insights. The ClearStory Data team has decades of combined experience at Aster Data, Cloudera, Google, Teradata, Oracle, Netscape and Opsware.',NULL,'3900-12-21','ClearStory Data',0,NULL,NULL,NULL,NULL,'www.clearstorydata.com',2011),(80098,NULL,'The Climate Corporation aims to help farmers around the world protect and improve their farming operations with powerful software and insurance products. The companys proprietary Climate Technology Platform‚ combines hyper-local weather monitoring, agronomic data modeling, and high-resolution weather simulations to deliver Climate Basic and Climate Pro‚ mobile SaaS solutions that helps farmers improve profitability by making better informed operating and financing decisions, as well as Total Weather Insurance, an insurance offering that pays farmers automatically for bad weather that may impact their profits. The company is also an authorized provider of the U.S. Federal crop insurance program, enabling authorized independent crop insurance agents to provide farmers with a powerful full-stack risk management solution. In the face of increasingly volatile weather, the global $3 trillion agriculture industry depends on the companys unique technologies to help stabilize and improve profits and, ultimately, help feed the world.',NULL,'3900-12-21','Climate Corporation',0,NULL,NULL,NULL,NULL,'http://www.climate.com',2007),(80099,NULL,'CliniCast builds comprehensive oncology solutions that enables providers to reduce the cost of managing cancer without compromising patient care. This solution integrates diverse data sources, performs a broad range of analysis —from populations to individual patients— and configures cancer care pathways.\n\nOverview\nBenefits include:\n    ● Measurements of cost, outcome, quality of life, pathway adherence and patient satisfaction.\n    ● Transparency into the cost utilization of oncology care to improve decisions.\n    ● Matching of patients to appropriate care pathways and track their progress\n    ● Identification of gaps in care and treatment variances to assist in determining care priorities.\n    ● Determination of opportunities to reduce costs without adversely affecting patient outcome',NULL,'3900-12-21','CliniCast',0,NULL,NULL,NULL,NULL,'http://clinicast.net/',2011),(80100,NULL,'CloudMade provides OEMs and application developers with a range of innovative tools and APIs that let them create unique location based devices and applications across all major web and mobile platforms. These solutions are cloud connected which keeps the maps and data fresh, keeps the users data synchronized across screens and links the user to their personal social data.',NULL,'3900-12-21','Cloudmade',0,NULL,NULL,NULL,NULL,'http://cloudmade.com',2007),(80101,NULL,'Cloudspyre LLC is a boutique custom software development company, specializing in developing mobile, cloud, and web-based software solutions. We build iOS, Android, and BlackBerry Apps to help people learn about the world around them. Cloudspyre also partners with other companies to do the programming side of their creative projects. Cloudspyre has expertise developing websites on a large variety of application platforms. Our favorite is building Ruby on Rails websites with custom backends. All the websites for Cloudspyres apps are built on Ruby on Rails.',NULL,'3900-12-21','Cloudspyre',0,NULL,NULL,NULL,NULL,'http://www.cloudspyre.com',2010),(80102,NULL,'Founded in 2009, Code for America (CfA) is a nonprofit that partners with local governments and citizens to foster civic innovation. By working to reinvigorate civic participation, accelerate the civic startup marketplace, facilitate collaboration between government leaders, and build new tools that enhance and strengthen communities, CfA is helping governments solve old problems in new ways. CfA is working towards a government by the people, for the people, that works in the 21st Century.',NULL,'3900-12-21','Code for America',0,NULL,NULL,NULL,NULL,'http://codeforamerica.org',2009),(80103,NULL,'Code-N is a cloud computing company that leverages an advanced semantic web technology to deliver software solutions to Big Data problems. Code-N is a software provider of concept-based business solutions that aims to make massive data interoperable, unambiguous, non-redundant, and accessible for extracting industry specific intelligence. \n\nCode-N is an Associated Partner of the Open PHACTS community and supports the Open Pharmacological Space, funded under the Innovative Medicines Initiative, a Public:Private Joint undertaking between EFPIA and the European Commission.',NULL,'3900-12-21','Code-N',0,NULL,NULL,NULL,NULL,'http://www.code-n.com',2010),(80104,NULL,'Collective IP was founded in 2011 with a singular mission: Accelerate the commercialization of global R&D through a marketplace that uniquely surfaces ideas, technologies and inventors; and quickly catalyze the connection between buyers and sellers of these assets in a revolutionary way. To accomplish this goal we built a comprehensive and accurate organization of technologies emerging from universities, companies and inventors.',NULL,'3900-12-21','Collective IP',0,NULL,NULL,NULL,NULL,'www.collectiveip.com',2011),(80105,NULL,'An ECMC initiative, College Abacus is a free service that allows users to compare their projected financial aid packages across schools and to identify schools within their budgets. Using net price calculators (NPCs) built by US colleges as mandated by the Higher Education Opportunity Act of 2008, College Abacus has built a system that generates estimates for more than 3800 post-secondary institutions in the United States.',NULL,'3900-12-21','College Abacus, an ECMC initiative',0,NULL,NULL,NULL,NULL,'https://collegeabacus.org',1994),(80106,NULL,'The College Board is a mission-driven not-for-profit organization that connects students to college success and opportunity. Founded in 1900, the College Board was created to expand access to higher education. Today, the membership association is made up of more than 5,900 of the world’s leading educational institutions and is dedicated to promoting excellence and equity in education. Each year, the College Board helps students prepare for a successful transition to college through programs and services in college readiness and college success — including the SAT® and the Advanced Placement Program®. The organization also serves the education community through research and advocacy on behalf of students, educators and schools.',NULL,'3900-12-21','College Board',0,NULL,NULL,NULL,NULL,'http://www.collegeboard.org',1900),(80107,NULL,'High medical bills are the leading cause of personal bankruptcy in the U.S.A primary cause of this is the lack of price and quality transparency in the medical industry. Two providers in Maryland can charge significantly different prices for the same procedure with the same quality of care. Patients typically do not know the cost of a procedure until after they receive the bill.\n\nComparedCare was founded in 2013 with the goal of providing patients the ability to compare the cost of care among providers within the same area. Users may upload / input their medical bill information anonymously (without any PHI or Personally Identifiable Information) into the ComparedCare medical bill repository. Patients can actively search for the cost of a medical procedure within their area for comparison, as well as read physician reviews submitted by patients. It is a one stop shop for medical pricing for patients.',NULL,'3900-12-21','Compared Care',0,NULL,NULL,NULL,NULL,'comparedcare.com',2014),(80108,NULL,'Compendia Bioscience aims to be the most relevant provider of high-value genomic data, helping our customers find cures for cancer using genomic data and suggesting available, high-potential therapies for individual patients based on their distinct genomic profiles.',NULL,'3900-12-21','Compendia Bioscience Life Technologies',0,NULL,NULL,NULL,NULL,'http://www.lifetechnologies.com/us/en/home/life-science/cancer-research/cancer-genomics/compendia-bioscience-life-technologies.html',2006),(80109,NULL,'Compliance & Risks provides companies with web-based Compliance Knowledge Management (CKM) solutions to get their products to market fully compliant with all applicable global and/or local legislations. Our aim is to liberate business from the complex regulatory environment. \n\nWe provide online tools that deliver the timely and accurate global regulatory intelligence. Our innovative product C2P is used by major Blue chip companies worldwide. C2P (Compliance-to-Product) is a web-based compliance knowledge management (CKM) system that integrates a daily-updated database of global regulations within compliance software and a knowledge management system. C2P replaces emails, spreadsheets, and paper trails with an online suite of communication and collaboration tools that are designed for managing compliance. It helps to organize each step of tracking global regulations, defining issues, assessing risks, assigning tasks, monitoring compliance, and producing reports all the way to full compliance.\n\nC&R currently supports the electronics hardware/software and the healthcare industries with its C2P solution.',NULL,'3900-12-21','Compliance and Risks',0,NULL,NULL,NULL,NULL,'http://www.complianceandrisks.com',2000),(80110,NULL,'Computer Packages Inc. provides intellectual property management systems and patent annuity payment services. Our exclusive patent audit service improves your ability to manage acquisitions and/or divestitures efficiently.',NULL,'3900-12-21','Computer Packages Inc',0,NULL,NULL,NULL,NULL,'http://www.computerpackages.com/',1968),(80111,NULL,'CONNECT-DOT are providers of data driven strategies and services, which deliver long term commercial and social benefits, based upon our clients key business requirements. The strategies evolved should be economical, efficient, durable and flexible and empower the organizations and governments to respond rapidly to both market and customer needs.',NULL,'3900-12-21','CONNECT-DOT LLC.',0,NULL,NULL,NULL,NULL,'http://conndot.com',2014),(80112,NULL,'ConnectEDU’s technology solutions empower students by informing their academic and career decisions. ConnectEDU manages data—including data acquisition, loading, standardization, normalization, storage, and security. To ensure a successful implementation of a product, suite of products or enterprise deployment, our data management solution is our core competency.',NULL,'3900-12-21','ConnectEDU',0,NULL,NULL,NULL,NULL,'http://www.connectedu.com',2002),(80113,NULL,'Connotate transforms web data and content into high-value information assets – to feed content products, grow market and business intelligence, enable mass data aggregation, migration and integration.\n\nConnotate’s patented intelligent Agent technology empowers both business users and programmers to quickly create data sets, new applications and content products. With Connotate, customers experience productivity gains, reduced costs, mitigated risks, more informed decision-making and strategic and competitive advantages.',NULL,'3900-12-21','Connotate',0,NULL,NULL,NULL,NULL,'http://www.connotate.com',2000),(80114,NULL,'The Construction Monitors vision is to compile and database every building permit (valuation over 10k) issued throughout the United States every week. Currently we have reached that goal in the Western United States and Texas. At the start of 2012 we launched a campaign to have the Eastern United States covered by the end of 2014. \n\nOver the years we have developed a proprietary system to collect database building permits in \"real time\". The data is used by the construction industry for leads to find new work and the financial industry to forecast economic trends. There are many other industries (both public and private) that use building permit data in many different ways.',NULL,'3900-12-21','Construction Monitor LLC',0,NULL,NULL,NULL,NULL,'www.constructionmonitor.com',1989),(80115,NULL,'Consumer Reports was founded in 1936 when consumers lacked a reliable source of information they could depend on to help them distinguish good products from bad ones. Since then Consumer Reports has filled that vacuum with a broad range of consumer information. Consumer Reports has a wide circulation in print and on its website, ConsumerReports.org, which has the most subscribers of any website of its kind. All of Consumer Reports work is informed by the more than 1 million readers who respond to our Annual Questionnaire, among the largest and most comprehensive consumer studies in the world. \n\nIn 2008, Consumer Reports also launched several initiatives, including the Consumer Reports Health Ratings Center, which serve to educate and empower consumers to make more informed healthcare decisions and to help change the market.',NULL,'3900-12-21','Consumer Reports',0,NULL,NULL,NULL,NULL,'www.consumerreports.org',1936),(80116,NULL,'The CoolClimate Network (CCN) is a division of UC Berkeleys Renewable and Appropriate Energy Laboratory (RAEL). CCN carries out research on carbon footprint mitigation, develops carbon management tools for public, business and government users and implements best practice programs grounded in behavior research to engage business and individuals in voluntary carbon reductions. All calculations and data are fully transparent, published on our website and in peer-reviewed research.',NULL,'3900-12-21','CoolClimate',0,NULL,NULL,NULL,NULL,'http://coolclimate.berkeley.edu',2007),(80117,NULL,'Copyright Clearance Center (CCC) is a global rights broker for the world’s most sought-after books, journals, blogs, movies and more. CCC provides smart solutions that simplify the access and licensing of content. These solutions let businesses and academic institutions quickly get permission to share copyright-protected materials, while compensating publishers and creators for the use of their works. CCC provides information solutions to companies of all sizes, as well as academic institutions, law firms, healthcare organizations and government agencies.',NULL,'3900-12-21','Copyright Clearance Center',0,NULL,NULL,NULL,NULL,'http://www.copyright.com',1978),(80118,NULL,'CoreLogic is a leading global property information, analytics and data-enabled services provider. The companys combined data from public, contributory and proprietary sources includes over 3.3 billion records spanning more than 40 years, providing detailed coverage of property, mortgages and other encumbrances, consumer credit, tenancy, location, hazard risk and related performance information. The markets CoreLogic serves include real estate and mortgage finance, insurance, capital markets, and the public sector. CoreLogic delivers value to clients through unique data, analytics, workflow technology, advisory and managed services. Clients rely on CoreLogic to help identify and manage growth opportunities, improve performance and mitigate risk. Headquartered in Irvine, CA, CoreLogic operates in North America, Western Europe and Asia Pacific.',NULL,'3900-12-21','CoreLogic',0,NULL,NULL,NULL,NULL,'http://www.corelogic.com',2010),(80119,NULL,'CostQuest Associates information systems and services deliver comprehensive solutions to complicated business challenges. These solutions reflect the highly specific needs of businesses, including the impact of financial, economic, and regulatory environments. CostQuest has also provided proprietary profitability, cost, telecom engineering, and metrics systems along with demographic data, data analysis, and GIS support to enhance decision-making in some of the world’s leading companies.',NULL,'3900-12-21','CostQuest',0,NULL,NULL,NULL,NULL,'http://www.costquest.com',1990),(80120,NULL,'Credit Karma helps users manage their debt and finances by finding the best savings options for  credit cards, mortgage, auto loans, and more. Credit Karma enables users to quickly and easily track their credit score, credit attributes, and debt over time, from a single source.\n\nUse our free interactive tools and simulators to help you learn how to anticipate changes in your credit score.  Use our credit report card to compare and learn more about your credit report and how financial institutions view you. Compare your credit report to others and see how the various items on your credit report affect your credit score.',NULL,'3900-12-21','Credit Karma',0,NULL,NULL,NULL,NULL,'https://www.creditkarma.com',2007),(80121,NULL,'Credit Sesame was founded on a simple principle: Assets – Liabilities = Wealth, and the recognition that most people overlook a significant contributor to this equation - the mortgages, loans and credit cards we pay each month. We help people manage their credit and loans to building wealth. With our deep expertise in developing bank-level credit and loan analytics, and the belief that transparency and access to financial information are fundamental consumer rights, we established Credit Sesame in 2010.',NULL,'3900-12-21','Credit Sesame',0,NULL,NULL,NULL,NULL,'creditsesame.com',2010),(80122,NULL,'CrowdANALYTIX is an on-demand, crowd-sourced service providing data science expertise to analytics managers and their teams in enterprises and professional services firms. \n\nCrowdANALYTIX operates a crowdsourcing platform in which a large and growing community of independent data scientists solve customer problems using data science contests and publicly accessed data. A CrowdANALYTIX solution manager is responsible for managing the partner project with the community to completion.\n\nCrowdANALYTIX is headquartered in the Silicon Valley and has received investments from leading venture capital firms.\n\nFor more information, please visit www.crowdanalytix.com/partners \n',NULL,'3900-12-21','CrowdANALYTIX',0,NULL,NULL,NULL,NULL,'www.crowdanalytix.com',2012),(80123,NULL,'Dabo Health is an information platform that brings clarity to quality metrics, makes them actionable to hospitals and care providers, and facilitates collaboration for quality improvement.\n\nOur mission is to apply the power of teamwork and data transparency to improve outcomes and meet the needs of patients efficiently. All members of the care team play a critical role in patient outcomes: by providing enterprise awareness around metrics, we break down hierarchies and give care providers an equal voice to create local, regional, and national performance improvement.',NULL,'3900-12-21','Dabo Health',0,NULL,NULL,NULL,NULL,'https://www.dabohealth.com/#/',2011),(80124,NULL,'Datalogix provides marketing infrastructure by connecting digital advertising to offline sales. We help brands reach audiences of buyers across display, video, mobile and social. DLX ROI is a proprietary tool that measures the offline sales lift resulting from digital marketing campaigns. The company’s fields of involvement span the major consumer segments, including Retail, CPG, Telecom, Travel, Financial Services and Automotive. Datalogix also offers predictive analytics for Direct Mail, and integrated media solutions via the DLX Net.  \n\nDataLogix is based in Colorado, with offices in New York City, San Francisco, Boston, Chicago, Detroit, and London.',NULL,'3900-12-21','DataLogix',0,NULL,NULL,NULL,NULL,'http://www.datalogix.com',2002),(80125,NULL,'DataMade is a civic technology company. We work on projects that make open data, make open source software, and make people more powerful.',NULL,'3900-12-21','DataMade',0,NULL,NULL,NULL,NULL,'http://datamade.us',2012),(80126,NULL,'DataMarket helps people find and understand data. We bring complex and diverse data together in one place and one format so it can be searched, compared, visualized and shared across teams, organizations or on the web. DataMarket is licensed to enterprises and data publishers as a white-label SaaS solution and includes seamless access to our ever-expanding collection of facts and figures from leading global data providers. Our open data portal, datamarket.com, enables anyone to use our search and visualization technology to explore a vast amount of key public data from around the world, whenever they wish and free of charge.',NULL,'3900-12-21','DataMarket',0,NULL,NULL,NULL,NULL,'datamarket.com',2008),(80127,NULL,'Datamyne provides a web-enabled suite of analytic tools for searching, saving, and downloading trade data records for their specific business needs.\nOur search capabilities include everything from import and export ranking, product type and price, freight origin and destination, specific company trading activities, and more.\n\nOur coverage encompasses key markets in Latin America, Asia, Africa, and the European Union, as well as US maritime commerce as documented in house and master bills of lading. Our integrated suite of online products offers multiple perspectives on international trade, including current rankings of trade flows, details of shipments, and 360-degree profiles of buyers, sellers and service providers.',NULL,'3900-12-21','Datamyne',0,NULL,NULL,NULL,NULL,'http://www.datamyne.com',1992),(80128,NULL,'DataWeave is an eCommerce Price Intelligence product that lets eCommerce portals monitor price changes to products across the Web in a easy manner. Managers can monitor changes to prices, stock availability, and daily reports to be abreast with the changes and take decisions accordingly.',NULL,'3900-12-21','DataWeave',0,NULL,NULL,NULL,NULL,'www.dataweave.com',2011),(80129,NULL,'Deloitte delivers services in four areas — audit, financial advisory, tax and consulting — and combines the talents of those groups to address clients’ needs.',NULL,'3900-12-21','Deloitte',0,NULL,NULL,NULL,NULL,'http://www.deloitte.com',1845),(80130,NULL,'DemystData helps leading financial institutions tap into online, social, traditional and internal \"Big Data\" to make better credit decisions. The company’s products enable real-time analysis of both consumer and small business profiles.',NULL,'3900-12-21','DemystData',0,NULL,NULL,NULL,NULL,'http://demystdata.com',2011),(80131,NULL,'The Department of Better Technology works with government organizations to build and maintain custom applications, or to support open source applications that already exist. Through working closely with organizations like Code for America, were able to find, integrate, and support web and information technology projects well below standard market prices.\n\nWe can also act as technical advisors to your internal projects. We help local governments think through technical projects, provide technology advice on how to craft RFPs, and help get great local or national vendors to bid on them. By using us as an outside strategist, were able to save you thousands of dollars. We help organizations ask for the right thing, plan small, agile procurements, and get the right people at the table for the job.\n\nWe dont just deal with \"citizen experience\" -- we think that employee experience matters too. You and the people you work with should be using software you love using. Software that is not only great to look at, but also gets you home on time. We hand-craft pixel-perfect software for the guts of government.',NULL,'3900-12-21','Department of Better Technology',0,NULL,NULL,NULL,NULL,'dobt.co',2013),(80132,NULL,'Development Seed is a creative strategy and engineering team that helps empower citizens and organizations with tools and data to solve complex issues and make better decisions. We are an integrated team of strategists, designers, and developers that work to solve the challenging development and governance issues with real solutions.\n\nWe are a small team that has implemented some of the largest open data projects in international development. We work together with our partners to solve complex communications challenges using data visualizations, interactive web content, and custom applications. Our work runs the spectrum of identifying key problems, strategizing opportunities, building solutions, and designing communications. At our core, we are engineers building incredibly fast and flexible open source tools that provide the foundation for our solutions. This approach allows us to tackle large scale projects in record time, whether that’s taking the World Bank from concept to site launch with data.worldbank.org, helping Internews and NAI expose patterns of violence against journalists on the ground in Afghanistan, or building open.undp.org, the United Nations Development Programmes flagship project portal.',NULL,'3900-12-21','Development Seed',0,NULL,NULL,NULL,NULL,'developmentseed.org',2004),(80133,NULL,'Docket Alarms performs full text, advanced legal search across millions of documents and dockets in Federal Courts, Bankruptcy Courts, the ITC, and the PTAB.\n\nWe support advanced search queries such as stemming, proximity queries, and robust filtering tools.',NULL,'3900-12-21','Docket Alarm, Inc.',0,NULL,NULL,NULL,NULL,'www.docketalarm.com',2012),(80134,NULL,'Dow Jones & Company is a global provider of news and business information, delivering content to consumers and organizations via newspapers, Web sites, apps, video, newsletters, magazines, proprietary databases, conferences, and radio.\n\nDow Jones brands include The Wall Street Journal, Barron’s, MarketWatch, Factiva, Dow Jones Risk & Compliance, Dow Jones VentureSource, and DJX. Its information services publish in 13 languages and distribute content in 28 languages, combining technology with news and data to support business decision making.',NULL,'3900-12-21','Dow Jones & Co.',0,NULL,NULL,NULL,NULL,'http://www.dowjones.com',1882),(80135,NULL,'D&B is a leading source of commercial information and insight on businesses, enabling companies to Decide with Confidence for 172 years. D&Bs global commercial database contains more than 225 million business records. The database is enhanced by D&Bs proprietary DUNSRight Quality Process, which provides our customers with quality business information to make critical business decisions.\n\nD&B provides solution sets that meet a diverse set of customer needs globally. Customers use D&B Risk Management Solutions to mitigate credit and supplier risk, increase cash flow and drive increased profitability; D&B Sales & Marketing Solutions to increase revenue from new and existing customers; and D&B Internet Solutions to convert prospects into clients faster by enabling business professionals to research companies, executives and industries.',NULL,'3900-12-21','Dun & Bradstreet',0,NULL,NULL,NULL,NULL,'http://www.dnb.com',1841),(80136,NULL,'For 20 years, Earth Networks has been Taking the Pulse of the Planet by gathering and analyzing atmospheric observations using the world’s largest weather observation and lightning detection networks so our customers can Know Before™. Real-time weather and lightning data – gathered every few seconds from thousands of sensors across the planet – keep consumers, businesses, and governments around the globe informed with neighborhood-level weather intelligence, updated with the most current forecasts, and alerted to approaching severe weather with the fastest alerts. The company’s popular WeatherBug® mobile, desktop and online apps, and website provide local weather, superior forecasts and advanced severe weather alerts to millions of consumers. Earth Networks’ enterprise solutions support utilities, schools, professional sports teams, emergency response crews, government entities and others in safeguarding lives, preparing for weather events, and optimizing business operations.',NULL,'3900-12-21','Earth Networks',0,NULL,NULL,NULL,NULL,'www.earthnetworks.com',1993),(80137,NULL,'EarthObserver is a mobile application created at the Lamont-Doherty Earth Observatory of Columbia University in the City of New York specifically for the iPhone®, iPod touch® and iPadTM. \n\nWith EarthObserver we invite you to visit and learn about our planet’s terrestrial landscapes, oceans and seas, frozen ice caps, atmosphere and clouds, geologic terrains, topography, nautical charts, natural hazards, human impacts, and many other earth and environmental science topics as you travel and explore with your finger .',NULL,'3900-12-21','EarthObserver App',0,NULL,NULL,NULL,NULL,'http://www.earth-observer.org/',2011),(80138,NULL,'Earthquake Alert! is a website provided by the United States Geological Survey’s (USGS) Earthquake Hazards Program as part of the effort to reduce earthquake hazard in the United States. We are part of the USGS Hazards Mission Area and are the USGS component of the congressionally established, multi-agency National Earthquake Hazards Reduction Program (NEHRP). The USGS participates in the NEHRP with the Federal Emergency Management Agency (FEMA), the National Institute of Standards and Technology (NIST), and the National Science Foundation (NSF). In the 2004 reauthorization of NEHRP by Congress, NIST has been given the lead role to plan and coordinate this national effort to mitigate earthquake losses by developing and applying earth science data and assessments essential for land-use planning, engineering design, and emergency preparedness decisions.',NULL,'3900-12-21','Earthquake Alert!',0,NULL,NULL,NULL,NULL,'https://play.google.com/store/apps/details?id=com.joshclemm.android.quake&hl=en',2013),(80139,NULL,'Eat Sleep Shop is an app that allows you to search for places to eat, shop & sleep and then read customer reviews as well as health, safety and labor highlights as a consumer in the know.',NULL,'3900-12-21','Eat Shop Sleep',0,NULL,NULL,NULL,NULL,'https://itunes.apple.com/us/app/eat-shop-sleep/id465262611',2012),(80140,NULL,'Ecodesk is a global supply chain sustainability service provider. At its core is an open cloud-based sustainability platform enabling businesses and organisations to hold their key non-financial metrics in a central location and providing the tool set for detailed analytics of the environmental and social impacts of the supply chain. These analytics enable the benchmarking of suppliers both internal and external to the supply chain and which can greatly reduce inherent risk, identify opportunities and drive efficiency changes.',NULL,'3900-12-21','Ecodesk',0,NULL,NULL,NULL,NULL,'https://www.ecodesk.com',2010),(80141,NULL,'eInstitutional generates actionable intelligence from all manner of public financial documents, inclusive of SEC filings, accounting statements, and prospectuses. We apply our proprietary analysis to identify key performance indicators that correlate with companies who outperform in the marketplace, and also flag those entities that appear to exhibit weaker profiles relative to peer group. We routinely scan gigabytes of data where documentation is reviewed on both a stand-alone basis and with cross-reference to thousands of other documents. Financial statements are additionally analyzed within the context of social media and real-time news events.',NULL,'3900-12-21','eInstitutional',0,NULL,NULL,NULL,NULL,'einstitutional.com',2008),(80142,NULL,'Embark, Inc. develops mass transit mobile applications for iPhone and Android users. It serves mass transit riders worldwide. The company was formerly known as Pandav Inc. and changed its name to Embark, Inc. in 2012.',NULL,'3900-12-21','Embark',0,NULL,NULL,NULL,NULL,'http://letsembark.com',2011),(80143,NULL,'EMC provides technologies and tools to help businesses design infrastructures to store and protect information so that it can be made accessible and actionable. EMCs promise is to help organizations of all sizes manage more information more effectively.',NULL,'3900-12-21','EMC',0,NULL,NULL,NULL,NULL,'http://www.emc.com/index.htm',1979),(80144,NULL,'Energy Points provides source energy intelligence software that enables organizations to analyze, manage, and strategically de-risk their energy supply chains. The platform uses geospatial data and sophisticated algorithms to quantify source energy, measuring energy use from its source to the site of consumption, while accounting for resource scarcity and environmental impact. With its source-to-site energy analytics senior management diagnose, flag, and address areas of high risk and spend, making information-driven decisions about their energy sources, including distributed energy alternatives.  Across the globe, Energy Points software is enabling enterprises to maximize their energy productivity and drive long-term business growth.',NULL,'3900-12-21','Energy Points, Inc.',0,NULL,NULL,NULL,NULL,'http://energypoints.com/',2011),(80145,NULL,'Energy Solutions Forum (ESF) is an energy policy infotech company. Our data product, EnerKnol, provides energy investors for the first time, access to real-time, comprehensive source of U.S. energy policy information from state, federal, and local regulators, thus driving investments forward by solving the problem of inaccessible fragmented data across 80,000+ government offices. ESFs flagship product, ESF Research, conducts macro- and industry-level analyses around the highly fragmented government regulations and policies that impact energy markets. \n\nESF is also the founding sponsor of New York Energy Week, a series of \"for the industry, by the industry\" events, launched to foster collaboration and investment in New Yorks rapidly growing energy economy. ESF founded the initiative based on the companys broader vision to fuel industry investment through cross-sector data products and research designed for all sectors of the diverse, and often fragmented, energy industry.',NULL,'3900-12-21','Energy Solutions Forum',0,NULL,NULL,NULL,NULL,'energysolforum.com',2011),(80146,NULL,'Enervee is an energy efficiency data and marketing platform, enabling consumers, businesses and governments to purchase the most energy efficient products.\n\nWe connect retailers, manufacturers, governments and utilities to provide an integrated product recommendation platform that is distributed via online, in-store, mobile and social channels.\n\nThe Enervee Score provides a universal way of comparing a product’s energy efficiency against all models available on the market. It is updated daily and reflects new products as they are introduced.\n\nThrough real time analysis of price, energy cost, popularity and market share, our algorithms produce highly targeted recommendations that can be used in email marketing, direct mail advertising and banner ads. The Enervee partner network provides the opportunity to promote energy efficient products directly to millions of customers at the places they already shop.\n\nEnervee provides the following products and services: government market research & compliance, utility rebate & incentive marketing, retail/manufacturer efficiency score cards & digital ads, and corporate procurement & sustainability.',NULL,'3900-12-21','Enervee Corporation',0,NULL,NULL,NULL,NULL,'http://enervee.com',2010),(80147,NULL,'Enigma.io is a platform that centralizes, mines and relates big public data about companies, people and locations. Offering one of the largest and broadest repositories of public data on the market, Enigma draws together sources as diverse as SEC filings, government spending contracts, liens, patents, asset ownership, bills of lading, and much more. Enigmas web-based application allows users to connect otherwise disparate and unorganized public data and its full-featured APIs empower developers extend their applications.',NULL,'3900-12-21','Enigma.io',0,NULL,NULL,NULL,NULL,'enigma.io',2011),(80148,NULL,'Ensco plc brings energy to the world as a global provider of offshore drilling services to the petroleum industry. Operating one of the world’s newest ultra-deepwater fleets and one of the largest fleet of premium jackups, we have a major presence in the most strategic offshore basins.\n\nOperating across six continents, our high-quality fleet (existing and under construction) includes 10 drillships, 13 dynamically-positioned semisubmersibles, 6 moored semisubmersibles and 45 premium jackups. In addition, we provide drilling management for two customer-owned deepwater rigs. Our rigs have drilled some of the most complex wells in virtually every major offshore basin around the globe.\n\nOur customers are multinational integrated energy companies, national oil companies and independent operators. With safety and operational excellence as our highest priorities, our skilled employees consistently exceed customer expectations, using our proven Safe Systems of Work. ',NULL,'3900-12-21','Ensco',0,NULL,NULL,NULL,NULL,'http://www.enscoplc.com/Home/default.aspx',1987),(80149,NULL,'Environmental Data Resources (EDR) provides information on businesses, properties and buildings to professionals in the financial, environmental, real estate, corporate, government, and legal sectors, and to other information companies. The company created and maintains the National Environmental Data Information System, or NEDIS, its proprietary aggregate database of environmental records and historical land use information culled from public records and private sources. Over 20 years in the making and updated continually, NEDIS contains 1,400 databases, some of which are proprietary, and more than 3.1 billion records.',NULL,'3900-12-21','Environmental Data Resources',0,NULL,NULL,NULL,NULL,'http://www.edrnet.com',1990),(80150,NULL,'Epsilon delivers direct-to-customer connections that drive business performance. Epsilon’s integrated solutions leverage the power of rich transactional and demographic marketing data, strategic insights, analytics, creative and robust digital and database marketing technologies to connect brands with consumers both online and offline, increasing engagement to generate measurable marketing outcomes.',NULL,'3900-12-21','Epsilon',0,NULL,NULL,NULL,NULL,'http://www.epsilon.com',1969),(80151,NULL,'The Demand Equal Pay for Women app makes it easy for everyone to see how the pay gap impacts nearly every woman in every industry. The app allows users to compare what theyre making with the national averages at the industry and occupation level, so users know how hard they need to push during salary negotiations.',NULL,'3900-12-21','Equal Pay for Women',0,NULL,NULL,NULL,NULL,'http://resources.alljobopenings.com/equality',2012),(80152,NULL,'Equifax can help you better understand your customers and prospects so you can grow your business intelligently across the customer lifecycle. With our suite of business data, predictive analytics, innovative solutions and industry expertise, you can improve the performance of your marketing and risk management programs to expand your market reach and efficiently grow and protect your revenues.',NULL,'3900-12-21','Equifax',0,NULL,NULL,NULL,NULL,'http://www.equifax.com/home/en_us',1899),(80153,NULL,'Equilar is an independent provider of high-quality executive data, tools, and analysis. We help leaders and companies improve by providing information and tools that strengthen