 sciences organizations worldwide to optimize the market access and commercial success of their products.',NULL,'3900-12-21','Evidera',0,NULL,NULL,NULL,NULL,'http://www.evidera.com',2013),(80160,NULL,'Experian provides information, analytical tools and marketing services to organizations and consumers to help manage the risk and reward of commercial and financial decisions.',NULL,'3900-12-21','Experian',0,NULL,NULL,NULL,NULL,'http://www.experian.com',1980),(80161,NULL,'EHDP provides Vitalnet for analyzing large complex health data sets, including BRFSS, birth, cancer, hospital discharge, mortality, pregnancy, and others. Vitalnet is a totally customized data warehouse software, guaranteed to work correctly with no risk of project failure. Vitalnet runs on the desktop, or over the internet in a browser.\n\n<br><br>A Vitalnet license includes programming, customization, user guides, train-the-trainer, problem resolution, and other support services needed to ensure project success. Flat-rate licensing simplifies purchasing and ensures no cost over-runs.\n\n<br><br>Vitalnet seeks to improve public health by making better use of government open health data. Vitalnet uses government open data inside the software. Also, the software is used to analyze government open data.\n\n<br><br>Vitalnet fulfills the role of many different kinds of software to benefit your organization, including: community assessment, data access, data analysis, data dissemination, data linkage, data mining, data query, data warehouse, decision support, educational, ICD database, and virtual data center.',NULL,'3900-12-21','Expert Health Data Programming, Inc.',0,NULL,NULL,NULL,NULL,'http://www.ehdp.com/',1997),(80162,NULL,'Exversion aims to improve accessibility and usability of all data. We believe that the future is in comparatively small, well assembled, thoroughly documented data sets. Exversion allows you to search 140,000+ datasets, consume through one API or upload your own data, and collaborate, publish, share or version-control with  your community.',NULL,'3900-12-21','Exversion',0,NULL,NULL,NULL,NULL,'https://exversion.com',2013),(80163,NULL,'Ez-XBRL Solutions, Inc. is a global provider of products and services for Financial Analytics and Financial Regulatory Compliance. Our analytics product - Contexxia - provides a unique way to combine and analyze unstructured and structured data to deliver a unique solution. Contexxia enables users to analyze and research SEC filings and other public disclosures by highlighting changes to text, events and financial data between two periods. A brief overview of features is available at http://youtu.be/AnmsI5LM9bY. Our team comprises of experts with significant knowledge and experience in a diverse set of domains and technologies, including financial services, XBRL, XML databases, Natural Language Processing and Semantic Analytics. Ez-XBRL is a member of XBRL US and is playing a key role in the development of XBRL standards and global adoption. The company is headquartered in the USA and has operations in the UK and India.',NULL,'3900-12-21','Ez-XBRL',0,NULL,NULL,NULL,NULL,'ez-xbrl.com',2009),(80164,NULL,'FactSet Research Systems provides multinational financial data and analytic software to financial institutions. FactSet consolidates tools to monitor global markets, public and private companies, and equity and fixed income portfolios in a single interface.',NULL,'3900-12-21','Factset',0,NULL,NULL,NULL,NULL,'http://www.factset.com',1978),(80165,NULL,'Factual is a data company that helps developers, publishers, and advertisers build more relevant and personalized mobile experiences using the context of location.',NULL,'3900-12-21','Factual',0,NULL,NULL,NULL,NULL,'http://www.factual.com',2007),(80166,NULL,'Farmers Insurance Group of Companies is a U.S. insurer group of automobiles, homes and small businesses that also provides a wide range of other insurance and financial services products. Farmers Insurance serves more than 10 million households with more than 20 million individual policies across all 50 states.',NULL,'3900-12-21','Farmers',0,NULL,NULL,NULL,NULL,'http://www.farmers.com',1928),(80167,NULL,'FarmLogs mission is to invent the future of farming. At FarmLogs we believe farming can leverage web and mobile software to improve efficiency and increase profits. We believe in putting the grower first.\n\nOur technology makes farming more efficient and more profitable as demand for food production continues to grow. The hard working people behind growing crops often get overlooked, but ultimately it is the farmer who is at the core of agriculture. By serving the farmer, we are serving the industry that we and our families come from and rely on.',NULL,'3900-12-21','FarmLogs',0,NULL,NULL,NULL,NULL,'farmlogs.com',2011),(80168,NULL,'Fastcases mission is to democratize the law and make legal research smarter. Fastcase has created new ways to access the law, with smarter legal research tools and free apps for iOS and Android devices. Fastcase also maintains the Public Library of Law, a free law library for non-lawyers.\n\nFastcase partners with 24 state bar associations to provide free legal research for their members, and today serve more than 600,000 subscribers.',NULL,'3900-12-21','Fastcase',0,NULL,NULL,NULL,NULL,'fastcase.com',1999),(80169,NULL,'Fidelity Investments is a provider of investment products and services. We are a financial services company that offers a range of product solutions for individual investors, employers, institutions and intermediaries.',NULL,'3900-12-21','Fidelity Investments',0,NULL,NULL,NULL,NULL,'https://www.fidelity.com',1946),(80170,NULL,'FindTheBest is a research engine focused on collecting, structuring, and connecting the world’s data — 60+ billion pieces of information to date — to lead people to the best conclusions. FindTheBest’s desktop site, mobile site and embeddable widgets let people thoroughly research all of their options in almost every topic, on one intuitive interface.',NULL,'3900-12-21','FindTheBest.com',0,NULL,NULL,NULL,NULL,'http://www.findthebest.com',2010),(80171,NULL,'FirstFuel Software is a commercial energy analytics company that helps utilities and government agencies deliver scalable energy efficiency across their commercial building portfolios. The company’s Remote Building Analytics platform uses advanced meter data analytics to identify, enable, and track energy efficiency savings behind the meter in commercial buildings - without onsite visits or device installations. ',NULL,'3900-12-21','First Fuel Software',0,NULL,NULL,NULL,NULL,'http://firstfuel.com',2009),(80172,NULL,'FirstPoint, Inc. is a national provider of information and operation services, offering Equifax credit solutions, revenue cycle management, decision data and organizational management.',NULL,'3900-12-21','FirstPoint, Inc.',0,NULL,NULL,NULL,NULL,'https://www.firstpointresources.com/',1941),(80173,NULL,'Fitch is a global provider of financial information services. Fitch Group is comprised of: Fitch Ratings, a provider of credit ratings and research; Fitch Solutions, a provider of credit market data, analytical tools and risk services; Fitch Learning, a provider of learning and development solutions for the global financial services industry; and Business Monitor International, a provider of country risk and industry analysis specializing in emerging and frontier markets.',NULL,'3900-12-21','Fitch',0,NULL,NULL,NULL,NULL,'https://www.fitchratings.com/web/en/dynamic/fitch-home.jsp',1913),(80174,NULL,'FlightAware provides private aviation flight tracking in over 45 countries across North America, Europe, and Oceania, as well as global solutions for aircraft with datalink (satellite/VHF) via every major provider, including ARINC, Honeywell GDC, Satcom Direct, and UVdatalink. \n\nFlightAware provides live flight data, airport delays, fuel prices, FBO reservations, weather maps, flight planning, flight routes, oceanic tracks, and navigation charts, as well as aviation news and photos to over three million users a month via the FlightAware.com web site as well as apps for iPhone/iPad, Android, BlackBerry, PlayBook, Symbian, Windows Phone, and Windows 8.\n\nFlightAware also powers operational management and dispatch software, airport flight information displays (FIDS), airport operational tools, third party mobile apps, and provides reporting data to aircraft and airport operators. ',NULL,'3900-12-21','FlightAware',0,NULL,NULL,NULL,NULL,'http://www.flightaware.com/',2005),(80175,NULL,'FlightStats is a leading global provider of data services and applications to the travel industry and traveling public. The company delivers real-time global flight status information, messaging and alerting, and complementary services that power many of the worlds most popular travel applications and support the operations of airlines, agencies and airports. Our historical archive of flight data is proving quite valuable in projects aimed at measuring and improving airline and airport operational efficiencies and in predictive analytics applications such as passenger flow modeling.\n\n\nFlightStats’ data reaches nearly 40% of global air travelers each day via our customers’ search engines, mobile applications, websites, FIDS boards, flight alerts and our own consumer properties. We’ve made a significant investment and notable progress in expanding our data coverage in key functional and geographic areas and shown continuous improvement in accuracy, reliability, and timeliness. FlightStats aims to be the most trusted and reliable source of global flight and airport data.',NULL,'3900-12-21','FlightStats',0,NULL,NULL,NULL,NULL,'http://www.flightstats.com/',2005),(80176,NULL,'FlightView aggregates and delivers accurate and timely day of travel information and content to travelers, airlines, airports and travel companies to improve customer satisfaction, operational efficiency and brand loyalty. \n\nFlightView builds, maintains, continually updates and publishes the world’s largest and most comprehensive flight database, enabling real-time and historical views of commercial and general aviation activity around the world. FlightView leverages its global flight information and travel technology experience to create mobile websites and applications, in-airport displays, web content, tracking maps, alerts and other applications for its customers. \n',NULL,'3900-12-21','FlightView',0,NULL,NULL,NULL,NULL,'http://www.flightview.com/',1981),(80177,NULL,'Food+Tech Connect is a media and research company building a network for innovators transforming the business of food. Through news, analysis and research, we help people identify and understand market needs, emerging technologies and successful business models. Through events, we connect the leading thinkers and doers from the worlds of food, agriculture, health and technology. Our goal is to accelerate innovation and feed the growing hunger to hack a healthier, more equitable and more profitable future for food.',NULL,'3900-12-21','Food+Tech Connect',0,NULL,NULL,NULL,NULL,'http://www.foodtechconnect.com',2010),(80178,NULL,'Forrester Research is an independent global technology and market research company providing proprietary research, consumer and business data, custom consulting, events, and peer-to-peer executive programs.',NULL,'3900-12-21','Forrester Research',0,NULL,NULL,NULL,NULL,'http://www.forrester.com',1983),(80179,NULL,'Foursquare makes apps that help people keep up and meet up with friends, and discover great places. Swarm is for people who want the fastest and easiest way to connect with their friends. The Foursquare app is for explorers who want to know about the best spots, and to share what they’ve found with others. ',NULL,'3900-12-21','Foursquare',0,NULL,NULL,NULL,NULL,'https://foursquare.com',2009),(80180,NULL,'Fujitsu is a leading Japanese information and communication technology (ICT) company offering a full range of technology products, solutions and services.  We use our experience and the power of ICT to shape the future of society with our customers.',NULL,'3900-12-21','Fujitsu',0,NULL,NULL,NULL,NULL,'http://www.fujitsu.com/us/',1935),(80181,NULL,'Funding Circle USA is an online loan marketplace that connects small businesses looking for up to $500K with investors. Funding Circle was founded with the mission of addressing  by connecting investors with small businesses to the benefit of both.\n\nPeople lend small amounts to multiple creditworthy businesses to spread their risk. In turn, those businesses borrow from a multitude of people through an auction mechanism to get a lower interest rate. Lenders are able to loan specifically to businesses in their community or businesses that meet certain criteria, such as being environmentally friendly.',NULL,'3900-12-21','Funding Circle',0,NULL,NULL,NULL,NULL,'https://www.fundingcircle.com',2010),(80182,NULL,'FutureAdvisor was founded on the premise that investing for your future does not have to be difficult or expensive; we believe low-cost index investing is the key. FutureAdvisors algorithm analyzes your existing 401(k), IRA, and other investment accounts and compares them to model portfolios. It then uses that data to recommend how you should allocate your money across various assets classes and suggests specific trades you should make to improve your portfolio diversification and cost efficiency.',NULL,'3900-12-21','FutureAdvisor',0,NULL,NULL,NULL,NULL,'https://www.futureadvisor.com',2010),(80183,NULL,'Fuzion Apps mission is to end the wage gap for women and minorities within 5 years. Our challenge to the wage gap is Aequitas, a mobile cloud solution, that enables users to take control of their career by making informed decisions.',NULL,'3900-12-21','Fuzion Apps, Inc.',0,NULL,NULL,NULL,NULL,'www.fuzionapps.com',2012),(80184,NULL,'Gallup consultants help private and public sector organizations boost organic growth through measurement tools, strategic advice, and education. \n\nGallup News reports empirical evidence about the worlds citizens based on Gallups continuous polling in 160 countries. The Gallup Business Journal provides hard-hitting articles and insights aimed at helping executives improve business outcomes based on Gallups experience boosting companies performance. Gallup also offers books with research on business, leadership, wellbeing, and politics, as well as coursework on the factors that drive individual and organizational performance.',NULL,'3900-12-21','Gallup',0,NULL,NULL,NULL,NULL,'http://www.gallup.com',1969),(80185,NULL,'Galorath has invested over two decades of research and development helping organizations better plan and control project costs, quality, duration and risk. Leveraging sophisticated modeling technology and project-applicable knowledge bases, SEER solutions accurately replicate real-world project outcomes more quickly and with greater accuracy than traditional estimating methodologies.',NULL,'3900-12-21','Galorath Incorporated',0,NULL,NULL,NULL,NULL,'www.galorath.com',1987),(80186,NULL,'As a global provider of navigation, Garmin is committed to making geospatial information products for automotive, aviation, marine, outdoor and sports companies. Our “vertical integration” business model keeps these functions in-house, giving us more control over timelines, quality and service.',NULL,'3900-12-21','Garmin',0,NULL,NULL,NULL,NULL,'http://www.garmin.com/en-US',1989),(80187,NULL,'Genability is a software company helping New Energy Companies build energy cost savings into their products and services. They include solar developers, energy services firms, EV manufacturers, and the makers of internet connected devices. Genability helps these New Energy Companies build energy intelligence into how their products work and are sold.',NULL,'3900-12-21','Genability',0,NULL,NULL,NULL,NULL,'http://genability.com',2010),(80188,NULL,'At GenoSpace, we are Digital Architects of Genomic Medicine. The company has developed software systems for securely storing vast amounts of genomic and health data and providing it in formats specific to its diverse user communities. GenoSpace for Clinical Care facilitates clinically actionable interpretation and report generation for precision medicine. GenoSpace for Research provides dynamic analysis, visualization and collaboration tools. GenoSpace for Patient Communities enables patient-centric exploration and advancement of personalized medicine.',NULL,'3900-12-21','GenoSpace',0,NULL,NULL,NULL,NULL,'https://www.genospace.com',2011),(80189,NULL,'Geofeedia is a location-based, open source social media monitoring and mining, complementing traditional keyword monitoring to gather data on a wider range of social activity. We help you cut through the clutter of social media in real time to improve engagement and drive business value, and uncover the hidden 70% of geo-tagged social media content that is missed by keyword-based discovery tools. \n\nOur patent-pending, cloud-based technology simplifies and focuses social media monitoring, analysis and engagement.  \n  \nOnce you create a Geofeed – by simply entering an address or drawing a boundary around a location on a map – you can search, monitor and analyze all social media activity from that location.',NULL,'3900-12-21','Geofeedia',0,NULL,NULL,NULL,NULL,'http://geofeedia.com/',2011),(80190,NULL,'GeoLytics provides demographic data, census demographics, market research data, and geocoding for social researchers and business marketing. Our software comes with built-in mapping capabilities that create thematic maps for instant spatial display of your demographic information. Business and marketing personnel use GeoLytics data for target marketing, customer profiling, and business site selection. Libraries, universities, and government agencies use GeoLytics for our population estimates, population projections,and GIS data.',NULL,'3900-12-21','Geolytics',0,NULL,NULL,NULL,NULL,'http://www.geolytics.com',1996),(80191,NULL,'Geoscape helps clients achieve growth by tapping into Americas fast growing Hispanic and multicultural markets. We provide consumer intelligence via strategic business consulting, database-driven analytics and automated systems to help our clients create competitive advantages for business development, marketing and distribution.',NULL,'3900-12-21','Geoscape',0,NULL,NULL,NULL,NULL,'www.geoscape.com',1995),(80192,NULL,'GetRaised is a free interface that helps to narrow the wage gap and helps people to get paid more. In order to do so, GetRaised has combined data from the government, users, and current job postings to create a salary engine. With the help of experts from human resources and employment offices, academics, and writers, we’ve created a raise request that is uniquely suited to help you get the raise you want.',NULL,'3900-12-21','GetRaised',0,NULL,NULL,NULL,NULL,'https://getraised.com',2010),(80193,NULL,'GitHub is a social network for programmers. The company builds tools that make collaborating and writing software easier, and enable powerful collaboration, code review, and code management for open source and private projects. ',NULL,'3900-12-21','GitHub',0,NULL,NULL,NULL,NULL,'https://github.com',2008),(80194,NULL,'Glassy Media is a digital production company that was hatched out of the MIT Media Lab. We are a team from MIT and built Super PAC App (superpacapp.org), a mobile app that brought transparency to the 2012 U.S. presidential campaigns.',NULL,'3900-12-21','Glassy Media',0,NULL,NULL,NULL,NULL,'http://www.glassymedia.com/',2012),(80195,NULL,'Founded in 1998, Golden Helix is known for helping genetic research groups working with large-scale DNA-sequencing or microarray data overcome the frustration and challenges of bioinformatic roadblocks: delayed projects, lack of quality findings, and low productivity.',NULL,'3900-12-21','Golden Helix',0,NULL,NULL,NULL,NULL,'http://www.goldenhelix.com/',1998),(80196,NULL,'GoodGuide provides the worlds largest and most reliable source of information on the health, environmental, and social impacts of products and companies. GoodGuides mission is to help consumers make purchasing decisions that reflect their preferences and values. We believe that better information can transform the marketplace: as more consumers buy better products, retailers and manufacturers face compelling incentives to make products that are safe, environmentally sustainable and produced using ethical sourcing of raw materials and labor.',NULL,'3900-12-21','GoodGuide',0,NULL,NULL,NULL,NULL,'http://www.goodguide.com',2007),(80197,NULL,'Google Maps is a web mapping service application and technology provided by Google, powering many map-based services, including the Google Maps website, Google Ride Finder, Google Transit, and maps embedded on third-party websites via the Google Maps API.',NULL,'3900-12-21','Google Maps',0,NULL,NULL,NULL,NULL,'https://www.google.com/maps/about/explore/',2005),(80198,NULL,'Google Labs Public Data Explorer makes large datasets easy to explore, visualize and communicate. As the charts and maps animate over time, the changes in the world become easier to understand.',NULL,'3900-12-21','Google Public Data Explorer',0,NULL,NULL,NULL,NULL,'https://www.google.com/intl/en/about/',2009),(80199,NULL,'EZGrantFiling is a secure digital workspace that provides a document management and archiving system - a collaborative environment for storing, organizing, and accessing grants documentation. Cloud-based tools translate data into federal grant administrative reports, effortlessly and instantly. Companies can rapidly review, certify, and transmit your required grant administration reports.',NULL,'3900-12-21','Government Transaction Services',0,NULL,NULL,NULL,NULL,'http://www.ezgrantfiling.com',2010),(80200,NULL,'The Government landscape is one of the most highly fragmented markets in the world. Govini takes big data generated by numerous federal, state, and municipal agencies and transforms it into content that is searchable, granular, current, malleable, and structured for analytics. The vast arcane nature of Government spending makes Govini’s suite of online tools highly valuable (indeed mission critical) to all vendors, as it determines the productivity of their sales and marketing organizations. Executives use Govinis subscription-based platform, mission-critical data, and proprietary benchmarks to make informed business decisions about their Government markets, products and client relationships.',NULL,'3900-12-21','Govini',0,NULL,NULL,NULL,NULL,'http://www.govini.com',2011),(80201,NULL,'GovTribe believes in the power of open government data. We also believe that you dont always need a CIO to pick the tools that make you successful. We democratize the information you need, as well as your choice of technology. You shouldnt have to wade through bad tech just to do you job.\n\nWith that in mind, GovTribe proudly offers our iPhone andiPad apps. Both apps gives you the world of government contracting in real time. With GovTribe, you can easily track projects, competitors, agencies, contracting officers, and much more.\n\nGovTribe is built with you -- the user -- in mind. No management approvals. No IT department support calls. No hoping youre on the distro. Own your career and join GovTribe today. Win more work. Its that simple.',NULL,'3900-12-21','GovTribe',0,NULL,NULL,NULL,NULL,'govtribe.com',2012),(80202,NULL,'FDAzilla (www.fdazilla.com) provides business intelligence to professionals to work smarter with the FDA. Specializing in intelligence related to FDA inspections and FDA 483 reports, FDAzilla is home to the largest online library of 483s, where users can purchase and download FDA 483 reports instantly and anonymously. FDAzilla also provides an FDA 483s/EIRs monitoring service for companies who want to gain a competitive advantage through on-going targeted FDA inspection data.',NULL,'3900-12-21','Govzilla, Inc.',0,NULL,NULL,NULL,NULL,'fdazilla.com',2011),(80203,NULL,'gRadiant Research LLC is in the business of developing  thermal therapy as a replacement for traditional excisional surgery.',NULL,'3900-12-21','gRadiant Research LLC',0,NULL,NULL,NULL,NULL,'gradiant-research.com',2008),(80204,NULL,'Graebel is a large, independently owned and operated, fully integrated corporate and residential relocation company.',NULL,'3900-12-21','Graebel Van Lines',0,NULL,NULL,NULL,NULL,'http://www.graebelmoving.com',1950),(80205,NULL,'Graematters mission is to speed innovative medical products to the patients who need them by providing superior regulatory intelligence that will improve the quality of medical product development and regulatory submissions.  \n\nWe aggregate and integrate regulatory data from multiple sources providing a single point for users to locate, analyze, and report on events and trends in the regulatory environment. Turning regulatory data into true regulatory intelligence brings better transparency to the often complex regulatory processes that bring innovative medical products to patients.',NULL,'3900-12-21','Graematter, Inc.',0,NULL,NULL,NULL,NULL,'www.graematter.com',2000),(80206,NULL,'Granicus provides cloud-based technologies for government transparency, legislative efficiency, and citizen engagement. Granicus offers a cloud platform and product suites designed specifically to help government agencies establish meaningful connections with citizens.',NULL,'3900-12-21','Granicus',0,NULL,NULL,NULL,NULL,'http://www.granicus.com',1999),(80207,NULL,'The mission of GreatSchools is to inform, inspire and support families, and help parents get a great education for their children.\n\nWe leverage the power of data and digital media to help parents find great schools, solve education-related problems, raise expectations for their childrens learning, develop education-related parenting skills, and access helpful resources online and in their community.',NULL,'3900-12-21','GreatSchools',0,NULL,NULL,NULL,NULL,'greatschools.org',1998),(80208,NULL,'We believe a strong nonprofit information infrastructure enables a social sector strong enough to tackle the great challenges of our time. GuideStar provides the key scaffolding - data, information, and knowledge - to enable effective philanthropy: better giving decisions, more effective programs, and measurable impact. We do that by gathering and disseminating information about every single IRS-registered nonprofit organization. We provide as much information as we can about each nonprofits mission, legitimacy, impact, reputation, finances, programs, transparency, governance, and so much more. We do that so people can make the best decisions possible based on high-quality, comprehensive information.',NULL,'3900-12-21','GuideStar',0,NULL,NULL,NULL,NULL,'http://www.guidestar.org',1994),(80209,NULL,'At H3 Biomedicine, drug discovery starts with the patient. With deep expertise in the genetics of cancer, we mine the large cache of publicly available cancer genomics data. Our scientists work outward from genetically defined populations to identify or to confirm therapeutic targets. Our discovery teams then apply the latest chemical synthesis and cell-based screening methods to rapidly classify and develop libraries of small molecules that interact with those targets. They also seek to develop biomarkers to facilitate patient identification and clinical testing. This disciplined method promises to produce a steady stream of novel anti-cancer compounds against targets that have not yet been \"druggable.\"',NULL,'3900-12-21','H3 Biomedicine',0,NULL,NULL,NULL,NULL,'http://www.h3biomedicine.com',2010),(80210,NULL,'Harris is an international communications and information technology company serving government and commercial markets in more than 125 countries.  Headquartered in Melbourne, Florida, the company has approximately $5 billion of annual revenue and about 14,000 employees — including 6,000 engineers and scientists.  Harris is dedicated to developing best-in-class assured communications products, systems, and services.',NULL,'3900-12-21','Harris Corporation',0,NULL,NULL,NULL,NULL,'www.harris.com',1895),(80211,NULL,'HDScores is a team of serial entrepreneurs with various backgrounds and the vision to change the way we work with data, effect public health and food safety.',NULL,'3900-12-21','HDScores, Inc',0,NULL,NULL,NULL,NULL,'http://hdscores.com',2012),(80212,NULL,'Headlight is an award-winning online data system that enables local economic and workforce development agencies to produce data-intensive websites on their local economy.  Headlight uses open data from federal agencies, or data provided by the local organization.  Headlight has two products currently:  the Headlight portal and Career Headlight.  The Headlight portal aggregates all economic, demographic, workforce, and social time-series data into a single website in customizable dashboards.  See here for an example: http://charlestonregionaldata.com  A key benefit to clients is that all data is updated automatically when it is released through an automated batch process.  Career Headlight is a web app that helps students and adult workers identify career that are in demand in their local community and where to find the education.  By matching students to job demand, Career Headlight helps communities ensure that college graduates can find jobs and companies can find the workers they need.  A key feature of Career Headlight is the use of statistical modeling to simplify the ONET system and to bring job creation forecasts down to the county level. See Career Headlight in action: http://centralinacareerheadlight.com (login and password are “demo”).',NULL,'3900-12-21','Headlight',0,NULL,NULL,NULL,NULL,'HeadlightData.com',2011),(80213,NULL,'Consumers can access review and interpret information about comparative hospital quality, safety and patient experience on Healthgrades.com. We provide risk adjusted ratings of mortality and complications in 37 major disease condition or procedure cohorts in addition to risk adjusted patient safety ratings in 13 major AHRQ PSI categories. Helping to inform patients about where they are more likely to survive their hospitalization or leave without risk of major complications.',NULL,'3900-12-21','Healthgrades',0,NULL,NULL,NULL,NULL,'http://www.healthgrades.com/',1998),(80214,NULL,'Healthline Networks is a provider of health information and technology solutions for publishers, advertisers, employers, healthcare providers, and health plans. Originally founded as YourDoctor.com in 1999, the company relaunched in 2005 as Healthline Networks and is organized into two business units: Healthline Media and Healthline HIT Solutions.\n\nHealthline Media also manages HealthWEB—a network of health publishers that include Yahoo! Health, Drugs.com, and many others. Healthline HIT Solutions’ proprietary semantic taxonomy platform powers a suite of health search, data and content solutions that are used by application developers at global enterprises to address the health and wellness needs of providers, members and patients. Customers include Aetna, United Health, HCA HealthONE, Reed Elsevier, GE and Microsoft.',NULL,'3900-12-21','Healthline',0,NULL,NULL,NULL,NULL,'http://www.healthline.com',2005),(80215,NULL,'HealthMap is an established global leader in utilizing online informal sources for disease outbreak monitoring and real-time surveillance of emerging public health threats. \n\nRunning 365/24/7 in 15 languages, HealthMap brings together disparate data sources, including online news aggregators, eyewitness reports, expert-curated discussions and validated official reports. Using natural language processing and machine learning algorithms, HealthMap presents the firehose of information on an intuitive and user-friendly map, achieving a unified and comprehensive view of the current global state of infectious diseases and their effect on human and animal health. \n\nThe freely available website healthmap.org and mobile app Outbreaks Near Me deliver real-time intelligence on a broad range of emerging infectious diseases for a diverse audience including libraries, local health departments, governments, and international travelers. Various customizations of HealthMap with modified sources and taxonomy enable deep-dive surveillance of specific diseases and/or locations.',NULL,'3900-12-21','HealthMap',0,NULL,NULL,NULL,NULL,'http://healthmap.org/',2006),(80216,NULL,'HealthPocket is a start-up firm providing a free website to help consumers make informed health plan decisions in the era of healthcare reform. Using government data and nonprofit-sourced data, HealthPocket.com enables consumers to compare the cost and quality of all health plans available in a given zip code and also allows consumers to shop health plans by health plan acceptance by a doctor. All health plan data on the website is unbiased and does not get weighted by advertising concerns. Additionally, consumers can use the web site anonymously with no personally-identifiable information captured by HealthPocket.com. \n\nHealthPocket also leverages the government Open Data Initiative to produce nonpartisan research reports on the American health insurance market.',NULL,'3900-12-21','HealthPocket, Inc.',0,NULL,NULL,NULL,NULL,'http://www.healthpocket.com',2012),(80217,NULL,'HelloWallet measures impact via a number of verticals. On the member side, these include retirement readiness, debt levels, emergency savings, and health savings. On the employer side, HelloWallet helps enterprise customers optimize 401k plan investments, reduce healthcare costs, compensation costs, and tax liabilities, and increase employee engagement, well-being, and retention.',NULL,'3900-12-21','HelloWallet',0,NULL,NULL,NULL,NULL,'http://www.hellowallet.com/',2009),(80218,NULL,'HERE, a Nokia business, offers the fresh world maps and location experiences across multiple screens and operating systems. HERE inspires a new generation of location services and devices helping more people to navigate their lives with ease and confidence. Built on more than 25 years of experience in cartography and drawing on more than 80,000 sources of data, HERE offers \"Maps for Life\" for more than 190 countries, voice guided navigation in 95 countries in more than 50 languages and live traffic information for 34 countries.',NULL,'3900-12-21','HERE',0,NULL,NULL,NULL,NULL,'http://here.com',2012),(80219,NULL,'Honest Buildings is a New York City-based startup that has created a web platform to connect professionals in the real estate construction and design space. It is a more general marketplace for building solution providers to showcase portfolios of their work and connect with people looking to build new buildings or upgrade existing ones.',NULL,'3900-12-21','Honest Buildings',0,NULL,NULL,NULL,NULL,'https://www.honestbuildings.com',2011),(80220,NULL,'HopStop provides door-to-door mass transit directions and maps within several large metropolitan markets, including Atlanta, Baltimore, Boston, Chicago, London, New York, Paris, Philadelphia, Providence, San Francisco, and Washington, D.C.',NULL,'3900-12-21','HopStop',0,NULL,NULL,NULL,NULL,'https://www.hopstop.com/',2005),(80221,NULL,'Housefax is a national property data aggregation service that delivers convenient, consolidated home reports including building permits, mortgage information, fire, flood, catastrophe history and other residential property records. Housefax is a \"one-stop-shop\" residential intelligence tool for todays smart homebuyers.\n\nHousefax aggregates a variety of public and proprietary data, gathering accurate and reliable property details from the most accredited sources into one easy-to-understand report. The data services team is constantly researching and developing new features, tools and additional data points in order to provide useful property history reports.',NULL,'3900-12-21','Housefax',0,NULL,NULL,NULL,NULL,'http://housefax.com/',2002),(80222,NULL,'Hows My Offer allows students to anonymously compare college award offer letters with others. Through the power of community anonymous offers will help other students make better decisions in the future too.',NULL,'3900-12-21','Hows My Offer?',0,NULL,NULL,NULL,NULL,'http://hmo.launchrock.com/',2014),(80223,NULL,'For five years, IBMers have been working with companies, cities and communities around the world to build a Smarter Planet. Weve seen enormous advances, as leaders are using an explosion of data to transform their enterprises and institutions through analytics, mobile technology, social business and the cloud. Weve also seen how this new era is starting to create winners. They’re changing how their decisions are made. Theyre redesigning how their teams work, reassessing how to serve their customers, and changing the very nature of business. Its the ability to harness data that gives these leaders their competitive advantage in the era of \"smart.\"\n\nToday, conventions once universally held are giving way to new perspectives, new ways of working, and new solutions across industries. Roles are changing. And more than ever, leaders need a partner to help them adapt. ',NULL,'3900-12-21','IBM',0,NULL,NULL,NULL,NULL,'www.ibm.com',1912),(80224,NULL,'ideas42 is a design and research lab that uses behavioral economics to address complex social problems. The work ideas42 does falls into three categories: First, educating decision makers and leaders in the power of behavioral economics and how to apply it. Second, assisting clients on projects with existing products, policies and programs to apply behavioral economics to make them more effective. Finally, inventing new ideas, processes, and products that use insights from BE. This work focuses on areas such as consumer finance, energy efficiency, education, increasing up-take of social programs, economic mobility, and health, within the United States and around the world.',NULL,'3900-12-21','ideas42',0,NULL,NULL,NULL,NULL,'ideas42.org',2008),(80225,NULL,'iFactor Consulting develops software products and offers professional services for the utility industry. Our products and solutions focus on customer communications, allowing utilities to leverage connected technologies such as the web, mobile web, and smart phones to interact with their customers. \n\niFactors products include Storm Center, the industry leading platform for utility outage communications, Notifi, our innovative customer preference management and proactive communications offering, and Mobile, our suite of off the shelf customer service Apps delivering high value transactions on the iPhone and Android platforms. The company also offers Streetlightoutages.com which uses an interactive map for managing outdoor light incident reports and Web Maps Connector which allows users of Smallworld GIS to access a wide array of cloud-based mapping data directly in Smallworld. ',NULL,'3900-12-21','iFactor Consulting',0,NULL,NULL,NULL,NULL,'http://www.ifactorconsulting.com',2004),(80226,NULL,'IFI CLAIMS Patent Services has been dedicated to enriching and curating patent information since the 1950s. IFI CLAIMS specializes in annotating and classifying patent and scientific documentation using expert curators and intelligent technologies. \n\nIFI continues the tradition of enabling access to high quality patent data with CLAIMS Direct -- an open data platform and web service providing access to the IFI CLAIMS Global Patent database. CLAIMS Direct can be accessed via web services, installed in the cloud or in a local data center. It can allow the user complete control of their own patent database. The robust API allows easy integration of a comprehensive database into 3rd party applications.',NULL,'3900-12-21','IFI CLAIMS Patent Services',0,NULL,NULL,NULL,NULL,'www.ificlaims.com',1955),(80227,NULL,'iMedicare makes it easy to navigate the complexity of Medicare for patients, show preferred networks you are (and are not) in, and which plan reimburses your pharmacy best (and worst).\n\nMillions of Medicare patients walk into their pharmacy concerned about their Medicare plan coverage and how to save money. Pharmacists have the expertise to help them more than an insurance broker or a social worker can due to the complexities around Step Therapy, Prior Authorization, and Quantity Limits different plans require. We’ve seen time and time again how pharmacies that take the time to sit down and help patients see the highest profit returns.',NULL,'3900-12-21','iMedicare',0,NULL,NULL,NULL,NULL,'http://imedicare.com',2012),(80228,NULL,'Impact Forecasting is a catastrophe model development center of excellence within Aon Benfield whose seismologists, meteorologists, hydrologists, engineers, mathematicians, GIS experts, finance, risk management and insurance professionals analyze the financial implications of natural and man-made catastrophes around the world. Impact Forecasting’s experts develop software tools and models that help clients understand underlying risks from hurricanes, tornadoes, earthquakes, floods, wildfires and terrorist attacks on property, casualty and crop insurers and reinsurers. Impact Forecasting is the only catastrophe model development firm integrated into a reinsurance intermediary.',NULL,'3900-12-21','Impact Forecasting (Aon)',0,NULL,NULL,NULL,NULL,'http://www.aon.com/impactforecasting/impact-forecasting.jsp',1987),(80229,NULL,'Impaq International is focused on the evaluation of social programs and policies, particularly those that target assistance to the most vulnerable groups in society. We apply quantitative and qualitative research to conduct impact evaluations and research studies on workforce development, health, and education programs and policies. We thus help our clients identify programs and policies that are effective and help to support their implementation.',NULL,'3900-12-21','Impaq International',0,NULL,NULL,NULL,NULL,'http://www.impaqint.com',2001),(80230,NULL,'Import.io allows users to extract structured data from websites without writing any computer code. Users simply navigate to a website and teach the browser to extract data by showing it examples of where the data is; learning algorithms then generalize from these examples to work out how to get all the data on the website. The data that users collect is stored on import.io’s cloud servers to be downloaded and shared. Users can also generate an API from the data allowing them to easily integrate live web data into their own applications or third party analytics and visualization software. The import.io data browser is free to download from the website.',NULL,'3900-12-21','Import.io',0,NULL,NULL,NULL,NULL,'http://import.io',2012),(80231,NULL,'By applying analytics and proprietary application suites hosted on the IMS One intelligent cloud, IMS Health connects more than 10 petabytes of complex healthcare data on diseases, treatments, costs and outcomes to enable our clients to run their operations more efficiently. Customers include pharmaceutical, medical device and consumer health manufacturers and distributors, providers, payers, government agencies, policymakers, researchers and the financial community.',NULL,'3900-12-21','IMS Health',0,NULL,NULL,NULL,NULL,'http://www.imshealth.com/portal/site/imshealth',1954),(80232,NULL,'InCadence is a Salesforce certified partner and a professional services firm that provides comprehensive implementation and integration services for Salesforce.com and the Force.com cloud platform. We work primarily with non-profits, helping them to increase their impact through the use of technology. \n\nWith experience in software and web development, Internet technology, strategic consulting, and business development, InCadence consultants leverage the power of the Salesforce platform to provide customized, long-term solutions for clients. These solutions range from optimization projects to large-scale implementations.',NULL,'3900-12-21','InCadence',0,NULL,NULL,NULL,NULL,'http://incadence.com',2012),(80233,NULL,'Indoo.rs is a technology development company that creates indoor mapping, localization, and routing technology as well as SDK for application developers and device manufacturers. Indoo.rs enables end users to accurately locate themselves and others inside buildings, such as an airport, shopping mall or exhibition center, using a PC, tablet or smartphone. Developers need not worry about device characteristics, data processing, algorithms, etc. that are core to the technology. Instead they can add indoor navigation capabilities to their applications using the indoor.rs SDK. No additional hardware is needed and neither is access to the Wi-Fi.',NULL,'3900-12-21','indoo.rs',0,NULL,NULL,NULL,NULL,'http://indoo.rs/',2010),(80234,NULL,'InfoCommerce Group is a boutique consulting and research firm, serving the specialized business information publishing community. Our research, client project work and annual conferences provide the market with insight, information, and inspiration.\n\n\nThe InfoCommerce Group consulting practice has helped clients across the full range of business information products, but is particularly renowned for its expertise in all facets of commercial data publishing. InfoCommerce Group also offers knowledge and insight into the nuances of health content publishing through its health content advisory practice.',NULL,'3900-12-21','InfoCommerce Group',0,NULL,NULL,NULL,NULL,'http://infocommercegroup.com',2000),(80235,NULL,'Informatica Corporation provides data integration software and services that empower organizations to access, integrate, and trust all their information assets held in the traditional enterprise, off premise and in the Cloud. The company is a provider of enterprise data integration solutions for Oracle, PeopleSoft and Siebel environments. Informatica aims to give organizations a competitive advantage in today’s global information economy.',NULL,'3900-12-21','Informatica',0,NULL,NULL,NULL,NULL,'http://www.informatica.com',1993),(80236,NULL,'InnoCentive crowdsources innovation problems to people who compete to provide ideas and solutions to important business, social, policy, scientific, and technical challenges. Our global network of problem solvers, challenge methodology, and cloud-based innovation management platform combine to help our clients transform their economics of innovation through rapid solution delivery and the development of sustainable open innovation programs.',NULL,'3900-12-21','InnoCentive',0,NULL,NULL,NULL,NULL,'http://www.innocentive.com',2001),(80237,NULL,'Innographys subscription-based online information service provides answers to questions about intellectual property to help organizations improve their business results. Innography’s proprietary software suite corrects and correlates over 100 data sources and provides unique analysis and visualization technologies to enable users to quickly gain valuable insights for leveraging their patent portfolios, analyzing technology innovation trends and gaining competitive intelligence.',NULL,'3900-12-21','Innography',0,NULL,NULL,NULL,NULL,'http://www.innography.com',2007),(80238,NULL,'Innovests flagship product, a multi-currency enabled trust accounting and reporting system, is a secure, integrated, real-time, accrual based system offered in a Software in a Service (SaaS) environment. The product is a browser-based open system that comprehensively addresses the needs of trust companies, banks, private banks, retirement plan administrators and others that need to control, account for, and report on assets held in trust accounts.',NULL,'3900-12-21','Innovest Systems',0,NULL,NULL,NULL,NULL,'http://www.innovestsystems.com',2000),(80239,NULL,'Inovalon is a technology company that combines data analytics with highly targeted interventions to achieve meaningful impact in clinical outcomes and financial performance. Our achievement of value is delivered through the effective progression of Turning Data into Insight, and Insight into Action®. Proprietary datasets, sophisticated analytics, deep subject matter expertise, and nationwide in-community personnel deliver a seamless, end-to-end platform of technology and operations. Driven by data, Inovalon uniquely identifies gaps in care, quality, data integrity, and financial performance – while also bringing to bear the resources to resolve them. This differentiating combination provides a powerful capability suite touching more than 120 million Americans, driving high-value impact, and improving the quality and economics for health plans, hospitals, physicians, patients, and researchers.',NULL,'3900-12-21','Inovalon',0,NULL,NULL,NULL,NULL,'http://www.inovalon.com/pages/default.aspx',1998),(80240,NULL,'INRIX develops and operates a traffic intelligence platform, delivering smart data and analytics to solve transportation issues worldwide. Customers and partners include Audi, BMW, the BBC, Ford Motor Co, the I-95 Coalition, MapQuest, Microsoft, NAVIGON, Nissan, O2, Tele Atlas, TeleNav, Toyota and Vodafone.',NULL,'3900-12-21','Inrix Traffic',0,NULL,NULL,NULL,NULL,'http://www.inrixtraffic.com',2005),(80241,NULL,'Intelius specializes in public records information, offering services to consumers and businesses which include background checks and identity theft protection.',NULL,'3900-12-21','Intelius',0,NULL,NULL,NULL,NULL,'http://corp.intelius.com/',2003),(80242,NULL,'Intermap provides geospatial solutions on demand. Intermap is focused on improving the way people, businesses, and governments use location-based information. We collect, aggregate, and commercialize geospatial data from around the world, and innovate in geometric imaging, data acquisition, data aggregation, and more. \n\nWe help customers solve their geospatial and mapping problems by offering our Orion Platform which encompasses our geospatial services, foundation datasets, aggregation and delivery services, and 3DBI applications. Customers can leverage our solutions everyday to analyze and manage their data through Intermap’s services and products, which include RiskPro, GeoPro, the NEXTMap five-meter terrain datasets, and NEXTMap World 30, along with others. \n\nThe Orion integrated platform defines, designs, and delivers customized and scalable geospatial solutions. These geospatial solutions are used in a wide range of applications, including, but not limited to, geographic information systems (GIS), advertising, agriculture, engineering, GPS maps, insurance risk assessment, oil and gas, renewable energy, hydrology, environmental planning, wireless communications, and transportation. ',NULL,'3900-12-21','Intermap Technologies',0,NULL,NULL,NULL,NULL,'www.intermap.com',1996),(80243,NULL,'Investormill makes economic and financial data approachable to everyone. We do this by curating the most important components and delivering the data via an easy to use interface. We price in a way that is accessible for either one-time or recurring usage.',NULL,'3900-12-21','Investormill',0,NULL,NULL,NULL,NULL,'www.investormill.com',2012),(80244,NULL,'Iodine combines large healthcare datasets with a users individual needs and background to create a personalized resource for better understanding and decision-making about health. We believe that too much information offered to patients today is generic, anecdotal, and out-of-date. We believe that data science can create better information that will improve adherence, enhance behavior, and make people more confident about their health.',NULL,'3900-12-21','Iodine',0,NULL,NULL,NULL,NULL,'www.iodine.com',2013),(80245,NULL,'IPHIX uses data standards as enablers of cost savings and greater efficiencies in the collection and dissemination of public information and within an organizations internal environment. Our experience is derived from standardization projects based on the use of the Extensible Business Reporting Language (XBRL) within cross agency governmental projects, individual governmental agencies, commercial enterprises and other non-governmental entities, in the US and globally.',NULL,'3900-12-21','IPHIX',0,NULL,NULL,NULL,NULL,'iphix.net',2004),(80246,NULL,'iRecycle can tell you how, where and when to recycle just about anything. Using your current location, ZIP code, address or city, get access to vital details for collection points, such as Web site, phone number, directions, hours of operation and other materials collected.',NULL,'3900-12-21','iRecycle',0,NULL,NULL,NULL,NULL,'http://earth911.com/irecycle/',2009),(80247,NULL,'iTriage LLC, an Aetna subsidiary headquartered in Denver, CO, is a global health care technology company founded in 2008 by two emergency medicine physicians. The companys platform and mobile/web applications offer a proprietary Symptom-to-Provider pathway that empowers people to make better health care decisions. iTriage helps people answer the two most common medical questions: \"What could be wrong?\" and \"Where could I go for treatment?\" The free iTriage mobile app may be downloaded through the iTunes App store or Google Play Market, or customers may use the iTriage website at www.iTriageHealth.com. In addition, thousands of health care providers already use the iTriage platform to reach more consumers and increase patient engagement.',NULL,'3900-12-21','iTriage',0,NULL,NULL,NULL,NULL,'itriagehealth.com',2008),(80248,NULL,'Audit Analytics is an independent provider of audit, regulatory and disclosure intelligence. Audit Analytics’ comprehensive research is used daily around the world by the accounting, investment and legal communities for market intelligence, due diligence, compliance monitoring and trending.',NULL,'3900-12-21','IVES Group Inc',0,NULL,NULL,NULL,NULL,'http://auditanalytics.com/',2000),(80249,NULL,'IW Financial works closely with clients on guideline development, compliance, UN PRI implementation, portfolio customization, engagement, benchmarking, and product development. IW Financial’s research team produces data on more than 3,000 U.S. publicly traded companies covering more than 1,000 discrete data elements. IW Financial’s in-house research on more than 6000 global companies is available through IW Financial’s patented Workstation platform.',NULL,'3900-12-21','IW Financial',0,NULL,NULL,NULL,NULL,'http://info.iwfinancial.com',2001),(80250,NULL,'J. J. Keller & Associates, Inc. helps businesses, large and small, deal with the complex and constantly evolving regulations that affect their operations daily. We offer more than 12,000 products and services to help customers meet their safety needs and comply with regulations enforced by DOT, OSHA, EPA, FDA and 300 state agencies. As a source for safety and compliance solutions, we stay on top of new regulations and industry needs and respond with timely, carefully prepared solutions for the transport, workplace, human resources, food and construction markets.',NULL,'3900-12-21','JJ Keller',0,NULL,NULL,NULL,NULL,'http://www.jjkeller.com',1953),(80251,NULL,'J.P. Morgan Chase is a global financial services firm and a banking institution in the United States, with global operations. The company is engaged in investment banking, financial services for consumers and small businesses, commercial banking, financial transaction processing, asset management and private equity.',NULL,'3900-12-21','J.P. Morgan Chase',0,NULL,NULL,NULL,NULL,'http://www.jpmorganchase.com/corporate/Home/home.htm',1799),(80252,NULL,'Junar is a leading supplier of cloud-based software that streamlines the process for data-rich organizations to publish Open Data in the fastest and most cost effective manner. Once published, our platform enables data consumers to easily view, download, analyze and share the data. We enable clients in both the public and private sectors to achieve their strategic data sharing initiatives and fuel innovative, third-party applications.',NULL,'3900-12-21','Junar, Inc.',0,NULL,NULL,NULL,NULL,'www.Junar.com',2010),(80253,NULL,'Junyo develops data-centric solutions with the power to improve efficiencies and learning processes within the education system. We deliver innovative solutions that provide market intelligence and help make sense of the enormous amount of data available to schools, teachers and students. Our ultimate goal is to improve learning by helping ensure the right content and materials are delivered to the right schools and students at the right time.',NULL,'3900-12-21','Junyo',0,NULL,NULL,NULL,NULL,'http://junyo.com',2011),(80254,NULL,'Jurispect enables companies to make data-driven legal decisions. Jurispects software service tailors regulatory and legal updates to each users interests. It provides customized risk metrics and analytics for every rule and issue. With Jurispect legal intelligence, companies know exactly where to focus their legal and compliance efforts.',NULL,'3900-12-21','Jurispect',0,NULL,NULL,NULL,NULL,'jurispect.com',2013),(80255,NULL,'Kaisers mission is to improve the health of its members and the communities it serves, by creating safe, healthy environments and providing care and coverage for all. It offers nonprofit healthcare plans, and provides preventive care, well-baby and prenatal care, immunizations, emergency care, screening diagnostics, hospital and medical, and pharmacy services. It offers its services in California, Colorado, Georgia, Hawaii, Ohio, Oregon, Washington, and the District of Columbia.',NULL,'3900-12-21','Kaiser Permanante',0,NULL,NULL,NULL,NULL,'https://healthy.kaiserpermanente.org/html/kaiser/index.shtml',1945),(80256,NULL,'karmadata is healthcare (big) data, simplified. The karmadata team is on a mission to change the way businesses and consumers obtain and interact with healthcare information. Using big data and cloud technologies, karmadata standardizes and links the world’s healthcare data ranging from leading open data sources to private pharmacy and medical claims. Our users then follow items of interest (such as diseases, drugs, physicians, or corporations) through a real time Feed, create impactful visualizations through their Datacards, or subscribe to any application in our App Gallery.',NULL,'3900-12-21','karmadata',0,NULL,NULL,NULL,NULL,'www.karmadata.com',2011),(80257,NULL,'Keychain Logistics is a software marketplace that directly connects companies shipping products with independent semi-truck owner-operators. Our platform effectively cuts out the traditional third-party logistics brokerage process by virtue of a software enabled network of virtual carriers (trucks on the go in our network). We understand where trucks in our network are at any given moment, their capacity, and if they would be an ideal match for a company shipping.',NULL,'3900-12-21','Keychain Logistics Corp.',0,NULL,NULL,NULL,NULL,'www.keychainlogistics.com',2012),(80258,NULL,'Kid Admit is a way to apply to multiple San Francisco preschools online and help parents manage the preschool admission process by keeping them on top of important admission dates and deadlines.',NULL,'3900-12-21','KidAdmit, Inc.',0,NULL,NULL,NULL,NULL,'www.kidadmit.com',2012),(80259,NULL,'Our mission is to API-ify the web. \n\nKimono lets you build - analyses, visualizations, websites, smartphone and wearable apps, etc., - without worrying about getting the data you need. We do this by replacing web crawling and manual data entry - letting anyone extract and organize data from all across the web into APIs.',NULL,'3900-12-21','Kimono Labs',0,NULL,NULL,NULL,NULL,'kimonolabs.com',2014),(80260,NULL,'KLD is an independent research firm providing sustainability research and indexes: clients use KLD to integrate environmental, social and governance (ESG) criteria into investment decisions. It is part of RiskMetrics Group as of 2009.',NULL,'3900-12-21','KLD Research',0,NULL,NULL,NULL,NULL,'http://www.msci.com/products/esg/#',1988),(80261,NULL,'Knoema is a knowledge platform. The basic idea is to connect data with analytical and presentation tools. As a result, we end with one uniformed platform for users to access, present and share data-driven content. Within Knoema, we capture most aspects of a typical data use cycle: accessing data from multiple sources, bringing relevant indicators into a common space, visualizing figures, applying analytical functions, creating a set of dashboards, and presenting the outcome.',NULL,'3900-12-21','Knoema',0,NULL,NULL,NULL,NULL,'http://knoema.com/',2011),(80262,NULL,'The Knowledge Agency (TKA) operates in the fields of Strategic Intelligence (SI) and Intelligence Management (IM). We employ research and analytics to help our clients identify, measure, and manage opportunities for, and threats to, their competitiveness and value-production. TKA serves firms in health care; consumer products; information and media; financial and professional services; and government agencies.',NULL,'3900-12-21','Knowledge Agency',0,NULL,NULL,NULL,NULL,'http://www.knowledgeagency.com/',1989),(80263,NULL,'KPMG is a global network of professional firms providing Audit, Tax and Advisory services.',NULL,'3900-12-21','KPMG',0,NULL,NULL,NULL,NULL,'http://www.kpmg.com',1987),(80264,NULL,'Kroll Bond Rating Agency, a Nationally Recognized Statistical Rating Organization (NRSRO), was established by Jules Kroll to restore trust in credit ratings by establishing new standards for assessing risk and by offering accurate, clear and transparent ratings. KBRA provides the investment community with an alternative by delivering ratings designed to meet the highest standards for accuracy and timeliness.',NULL,'3900-12-21','Kroll Bond Ratings Agency',0,NULL,NULL,NULL,NULL,'https://www.krollbondratings.com/',2010),(80265,NULL,'Kyruus takes a Big Data approach to addressing the need for better matching and management of providers across the healthcare system. Matching the right physician to the right research project, drug development initiative, clinical trial, or patient has been a data-poor exercise to date. We work with organizations and physicians to help solve these problems by leveraging the deluge of healthcare data that exists (ranging from the tens of thousands of public domain sources, to the siloed data repositories within healthcare organizations, to self-reported data from physicians themselves) to understand the distribution of value and risk across those networks through archetyping, benchmarking, and predictive analytics. \n\nOur data-driven technology platform and products create information feedback loops that engage healthcare providers and administrators in targeted assessments of need and opportunity, as well as actionable workflow tools to drive optimization of performance and behavior.',NULL,'3900-12-21','Kyruus',0,NULL,NULL,NULL,NULL,'http://kyruus.com',2010),(80266,NULL,'Lawdragon is a legal news website with an annual magazine that provides coverage of high-profile legal matters and the attorneys handling them. Our best-known editorial feature is the \"Lawdragon 500 Leading Lawyers,\" our annual lawyers-of-the-year guide that we believe is the most elite distinction in the profession. We also report on international justice developments and have done in-depth features on human rights cases in South Africa, the former Yugoslavia and Rwanda.\n\nOur site also offers a free database of lawyers that lets companies and individuals search for and fill out evaluations of legal professionals, and provides a platform for lawyers to promote their services. \n\nWe are also building a new site on legal education that will provide regular editorial coverage of law schools and a school-search function for prospective students that we will market as an alternative to the U.S. News & World Report rankings. This will also provide evaluations of schools and professors.',NULL,'3900-12-21','Lawdragon',0,NULL,NULL,NULL,NULL,'lawdragon.com',2005),(80267,NULL,'LSP is a private company with a public mission: to increase public and professional access to legal information.  We are in the process of licensing our first product, LawAtlas: The Policy Surveillance Portal, to a new not-for-profit entity to be carried on as a public information service. LSP is moving into the professional legal information market, developing new statutory and regulatory products that deliver highly accurate coded legal data to lawyers and other policy professionals.',NULL,'3900-12-21','Legal Science Partners',0,NULL,NULL,NULL,NULL,'www.legalsciencepartners.net',2013),(80268,NULL,'(Leg)Cyte provides tools for Congressional staffers, lobbyists and public policy stakeholders. Our tools save users valuable time by streamlining, simplifying and ensuring more accurate legislative analysis. Were making legislation simple and smart.',NULL,'3900-12-21','(Leg)Cyte',0,NULL,NULL,NULL,NULL,'http://www.legcyte.com',2006),(80269,NULL,'LegiNation, Inc. was founded with the goal of making state level legislation more readily available to the professionals who need it, and even more importantly to the public at large. We are building products and websites to spark a renaissance in American politics, leveraging the internet to create the dialogue amongst our elected officials, legislative professionals, and everyday citizens.\n\nBillTrack50 is available for everyone to research state and federal legislation and legislators any time, for free. Our goal is to help people become informed about what their government is doing, and to connect with their representatives to offer their insights and knowledge where and when they are needed.\n\nBillTrack50 also provides simple, elegant tools for tracking and sharing bills, as a subscription service. These tools are appropriate for professionals and organizations who need to keep on top of legislative developments, and keep others (and /or the public) informed about bills as they progress through the process.',NULL,'3900-12-21','LegiNation, Inc.',0,NULL,NULL,NULL,NULL,'http://www.billtrack50.com/',2011),(80270,NULL,'LegiStorm is a professionals answer to whos who on Capitol Hill. We provide detailed, up-to-date and accurate congressional staff contact information. We go beyond phone numbers and verified email addresses to provide government affairs, advocacy, media, and academic professionals with detailed background information on staffers including social media links, salary and employment history, educational history, privately funded travel disclosures and much more.',NULL,'3900-12-21','LegiStorm',0,NULL,NULL,NULL,NULL,'http://www.legistorm.com/',2006),(80271,NULL,'Lenddo is an online platform that helps the emerging middle class use their social connections to build their creditworthiness and access local financial services. By combining community-based microfinance techniques with social media data, Lenddo is pioneering a new approach to serve the underbanked. We believe that the willingness of your community to vouch for you, coupled with data about how you behave online, can unlock opportunities to access much-needed financial services.',NULL,'3900-12-21','Lenddo',0,NULL,NULL,NULL,NULL,'https://www.lenddo.com/pages/what_is_lenddo/office',2011),(80272,NULL,'Lending Club was founded with the mission to create a more efficient alternative to the traditional banking system that provides lower rates to borrowers and better returns to investors. The company operates an online credit marketplace where investors provide loans to creditworthy borrowers in exchange for the interest income. Lending Club leverages technology to provide a simple, cost-efficient experience generating value that it passes on to customers. As of December 2013, more than $3 billion in loans have been issued to borrowers and nearly $300 million in interest payments have been returned to investors.',NULL,'3900-12-21','Lending Club',0,