ement and homeland security initiatives.',NULL,'3900-12-21','LexisNexis',0,NULL,NULL,NULL,NULL,'http://www.lexisnexis.com/en-us/home.page',1977),(80275,NULL,'Liberty Mutual Insurance Company provides insurance products and services for restaurants, hotels, manufacturing businesses, and individuals and their families. It offers its insurance through its call center, website, and representatives, as well as through independent agents/brokers and benefit consultants.',NULL,'3900-12-21','Liberty Mutual Insurance Cos.',0,NULL,NULL,NULL,NULL,'http://www.libertymutual.com',1912),(80276,NULL,'By providing a platform for idea-sharing, Lilly Open Innovation Drug Discovery lowers the barrier for collaborations between investigators working inside and outside an organization. Lilly is dedicated to the goal of becoming part of a Fully Integrated Pharmaceutical Network (FIPNet). A key part of this transformation is to expand the level of collaborative research with universities, institutes, and biotech to fuel innovative discovery.\n\nWe hope that investigators from all over the world will take advantage of this resource and that it will open new venues to test novel therapeutic hypotheses and deepen our understanding of complex biological systems.',NULL,'3900-12-21','Lilly Open Innovation Drug Discovery',0,NULL,NULL,NULL,NULL,'https://openinnovation.lilly.com/dd/',1876),(80277,NULL,'Liquid Robotics provides data services with Wave Glider, a marine robot that helps address climate change, national security, and offshore energy and resource management. The Wave Glider is changing both the economics and the technical envelope for ocean observation, data collection and communication. \n\nOffering a platform for low-cost, persistent operations at sea, Liquid Robotics has attracted customers and users across its target markets in science, defense and oil & gas. Rather than spend $10K-$155K per day to operate an oceanographic vessel, customers can now launch an unmanned Wave Glider for