hat define the world) in clearer, more actionable ways.\n\nWe love helping people get on top of big problems like foreclosure prevention, blight identification and reduction, the reuse of vacant space, and the preservation of community assets.',NULL,'3900-12-21','LOVELAND Technologies',0,NULL,NULL,NULL,NULL,'www.makeloveland.com',2010),(80284,NULL,'Lucid is a software technology company that enables connected buildings. Lucids BuildingOS integrates data from all systems, meters, and devices in commercial buildings into a single, modern platform with intuitive energy management tools that everybody can use. The cloud-based operating system connects with building automation systems, sub-meters, lighting controls and on-site generation, and accesses EPA emissions data, weather data, and Green Button data. BuildingOS has strong traction in large multi-site deployments in education, city government, Fortune 500, and healthcare. BuildingOS is becoming the default operating system for buildings because it is driving the industry in the direction of true interoperability, eliminating vendor fragmentation and reducing the cost of metering and systems integration. In 2004, Lucid pioneered the concept of real-time feedback on energy and water use delivered on the web with Building Dashboard. For more information, please visit http://www.luciddesigngroup.com.',NULL,'3900-12-21','Lucid',0,NULL,NULL,NULL,NULL,'http://www.luciddesigngroup.com',2004),(80285,NULL,'Founded in 2010, Lumesis Inc. is a financial technology company focused on providing business  efficiency, data and regulatory solutions for the Municipal marketplace under the DIVER brand. Providing access to hundreds of datasets, DIVER solutions leverage the most current economic and demographic data available from both public and private sources. Our solutions are tailored to address the unique needs of our clients comprised of  U.S. Banks, Broker/Dealers, Asset Managers, Insurance Companies, Hedge Funds and others.',NULL,'3900-12-21','Lumesis, Inc.',0,NULL,NULL,NULL,NULL,'www.lumesis.com',2010),(80286,NULL,'Mango Transit is an advanced public transit app for Windows Phone powered by Bing and Nokia.',NULL,'3900-12-21','Mango Transit',0,NULL,NULL,NULL,NULL,'http://www.windowsphone.com/en-us/store/app/mango-transit/34083d75-dca6-4631-99be-4f9a3813dd73',2011),(80287,NULL,'Mapbox is an open source platform for designing and publishing maps and geographical data for both mobile and on the web. On Mapbox.com you can sign up and create a map within minutes, then simply embed the map via copy/paste on the web or build complex applications for web or mobile with it. Power anything from the contact page on a small blog to data visualizations of billions of data points to base maps for massive traffic on large scale sites. \n\nWe started Mapbox to make it easy for anyone to design and publish a beautiful custom map. Our platform gives developers the power to make maps that embody their product and brand. Mapbox helps you find bars on foursquare, search for hotels on Hipmunk, and organize notes in Evernote. With our global, autoscaling infrastructure and cross-device compatibility, integrating our maps into your apps is easy even if you have millions of users. Over the last 3 years our team of dedicated cartographers, data analysts, and software engineers has built our entire stack using open source software and open data.',NULL,'3900-12-21','Mapbox',0,NULL,NULL,NULL,NULL,'mapbox.com',2011),(80288,NULL,'Maponics builds and defines geographic boundaries that are meaningful at the local level, such as neighborhood boundaries, ZIP Codes, and school attendance zones. With our new geospatial analytics product, Context, customers are able to get insight into local character by syncing lifestyle and behavioral analytics to our GIS data products or customized polygons.\n\nLicensing Maponics map data, or contracting with Maponics for custom data needs, ensures that our customers deploy their offerings fast, accurately, and with a low total cost. We deliver map data in a wide range of formats, including API.',NULL,'3900-12-21','Maponics',0,NULL,NULL,NULL,NULL,'http://www.maponics.com/',2001),(80289,NULL,'Building on the core premise of providing accurate maps and directions to millions of people everyday, MapQuest.com helps people find local information, create trips or journeys and customize, personalize and share them with others.',NULL,'3900-12-21','MapQuest',0,NULL,NULL,NULL,NULL,'http://www.mapquest.com',1967),(80290,NULL,'Marinexplore is a big data company making it easy to work with planetary assets. Its core product MarineOS is a Cloud platform designed for spatio-temporal data, that enables to collecting, integrate, organize, process, visualize and distribute all major types, formats and conventions of ocean data. \n\nMarinexplore Global Public Data Initiative - Marinexplore.org - is a growing global partner network of 32 institutions offering fast access to a rich directory of well-organized environmental data from 40,000+ data streams. It provides powerful tools to find, explore and share ocean data, used by 7,000 data professionals.',NULL,'3900-12-21','Marinexplore, Inc.',0,NULL,NULL,NULL,NULL,'www.marinexplore.com',2012),(80291,NULL,'MarketSense is committed to providing actionable intelligence to create a more prosperous world by combining big data and digital marketing expertise. We work directly with businesses, provide data aggregation, analysis and management services, and fully support agencies and their needs.',NULL,'3900-12-21','MarketSense',0,NULL,NULL,NULL,NULL,'http://www.marketsense.com/',2013),(80292,NULL,'Marlin & Associates is an independent boutique financial and strategic advisory firm and investment bank focused on advising owners and managers of U.S. and international companies that provide software, data, and related services. The firm is based in New York City, with offices in San Francisco, CA, Washington, DC, Toronto, Canada, and Hong Kong, China.  \n\nMarlin & Associates Securities LLC, a wholly-owned subsidiary of Marlin & Associates Holding LLC, is a broker-dealer registered with the Securities and Exchange Commission and is a FINRA/SIPC member firm. Investment banking and/or securities are offered through Marlin & Associates Securities LLC.',NULL,'3900-12-21','Marlin & Associates',0,NULL,NULL,NULL,NULL,'http://www.marlinllc.com',2002),(80293,NULL,'Marlin, Alter & Associates provides background information on individuals and businesses.',NULL,'3900-12-21','Marlin Alter and Associates',0,NULL,NULL,NULL,NULL,'http://www.marlinalter.com/',0),(80294,NULL,'McGraw Hill Financial is a content and analytics company serving the capital and commodity markets. \n\nWe are home to some brands in finance and business, including: Standard & Poor’s Ratings Services, S&P Capital IQ, S&P Dow Jones Indices, Platts, J.D. Power, and McGraw Hill Construction. Our independent credit ratings, indices, analytics, price assessments and research provide clients with the intelligence to manage risk and identify opportunities to grow.',NULL,'3900-12-21','McGraw Hill Financial',0,NULL,NULL,NULL,NULL,'http://www.mhfi.com',1919),(80295,NULL,'McKinsey & Company is a global management consulting firm that advises the worlds leading businesses, governments, and institutions. We work with organizations across the private, public and social sectors. We have deep functional and industry expertise as well as breadth of geographical reach.',NULL,'3900-12-21','McKinsey',0,NULL,NULL,NULL,NULL,'http://www.mckinsey.com',1926),(80296,NULL,'MedWatcher is a web and mobile tool for both healthcare professionals and consumers that promotes drug, device, and vaccine safety. MedWatcher allows users to submit adverse event reports to the FDA using a streamlined form while providing them with real-time notifications of government safety alerts, reported adverse events, news and research, and social media activity for specified products. Endorsed and co-branded by the FDA, MedWatcher currently covers all US drugs, devices, and vaccines, with expansion into the EU in progress. \n \nHalf of all Americans take a prescription drug, yet 86% of adverse drug events go unreported, according to HHS, with most reports coming from manufacturers. Reports that do get submitted are processed by the FDA and made public on an irregular basis -- monthly, quarterly, or sometimes even less frequently. This information system is slow, resulting in many missed safety signals, and puts patients at risk.\n \nMedWatcher tackles this issue by making it vastly easier to report adverse events and by sharing adverse event data immediately with patient and provider communities. With direct involvement from patients, a high volume of data, and a user-friendly, transparent system, MedWatcher is a powerful tool for making drugs, devices, and vaccines safer.',NULL,'3900-12-21','MedWatcher',0,NULL,NULL,NULL,NULL,'http://www.medwatcher.org',2010),(80297,NULL,'Mercaris provides market data and online trading for organic, non-GMO and other identity-preserved agricultural commodities. This includes cash market price data, trade statistics, and other information. Mercaris also allows buyers and sellers to meet online to procure commodity crops and discover price. This information has never before been available to market participants in an accessible, relevant manner.',NULL,'3900-12-21','Mercaris',0,NULL,NULL,NULL,NULL,'http://www.mercaris.com/',2012),(80298,NULL,'Merrill Corporation offers business communication and information management outsourcing services. The Company offers document and data management, litigation support, branded communication programs, fulfillment, imaging, and printing services. Merrill DataSite provides a secure virtual workspace service that optimizes collaboration and information management across enterprises. Merrill serves customers worldwide.',NULL,'3900-12-21','Merrill Corp.',0,NULL,NULL,NULL,NULL,'http://www.merrillcorp.com',1968),(80299,NULL,'Merrill Lynch is one of the largest wealth management businesses in the world. The solutions our Financial Advisors offer include college savings strategies, retirement planning, eldercare, philanthropy, estate planning, small business services and cash management and banking solutions. Merrill Lynch Financial Advisors draw upon the combined investment insights of Merrill Lynch and the banking strength of Bank of America to unlock opportunities tailored to their clients’ needs in all areas of their financial lives. Merrill Lynch Global Wealth Management is part of Bank of America Corporation’s Global Wealth & Investment Management business.',NULL,'3900-12-21','Merrill Lynch',0,NULL,NULL,NULL,NULL,'http://www.ml.com/index.asp?id=7695_15125',1914),(80300,NULL,'MetLife, Inc. is a global provider of insurance, annuities and employee benefit programs, serving 90 million customers.',NULL,'3900-12-21','MetLife',0,NULL,NULL,NULL,NULL,'https://www.metlife.com',1868),(80301,NULL,'mHEALTHCoach offers an evidence base care coordination technology platform that automates patient follow up and safety monitoring tasks. Through the integration of Web-based tools, the mobile Internet, rich media, and powerful database technology, mHealthCoach is dedicated to improving efficiency, productivity and possibilities for the healthcare community, in order to bring about greater overall patient care. mHealthCoach offers solutions for patients, providers, pharmacies, medical practices, facilities and communities, and pharmaceutical companies.\n\nRoutine follow up visits are scripted as mobile and web sessions that keep providers, patients and care-givers connected in-between clinical visits. The automated plans track patient progress and monitor symptoms. The platform has clinical rules and medication safety monitoring guidelines that focus the care team’s attention on the patients who need most follow up care.',NULL,'3900-12-21','mHealthCoach',0,NULL,NULL,NULL,NULL,'http://mhealthcoach.com',2010),(80302,NULL,'MicroBilt Corporation is a source and provider of decision critical information that responsibly assists businesses in reducing risk and managing their business. MicroBilt provides online access to consumer and commercial credit bureau data with automated decisioning and collection services. With its PRBC Consumer Report with the FICO Expansion Score, MicroBilt is a leading provider of alternative credit data to businesses that want to offer credit and other financial services to the approximately 110 million underserved and underbanked consumers in the United States.\n\nMicroBilt is also a provider of proprietary financial data with its Integra Data which offers industry benchmarks, norms, valuation data, risk management tools, and other private company financial data that help companies get the answers they need when they need them. The company enables businesses to enhance their content offerings by delivering private labeled content or web sites to their established online communities. ',NULL,'3900-12-21','MicroBilt Corporation',0,NULL,NULL,NULL,NULL,'http://www.microbilt.com/',1978),(80303,NULL,'The Windows Azure Marketplace is an online market for buying and selling finished Software as a Service (SaaS) applications and premium datasets. The Windows Azure Marketplace helps connect companies seeking innovative cloud-based solutions with partners who have developed solutions that are ready to use.',NULL,'3900-12-21','Microsoft Windows Azure Marketplace',0,NULL,NULL,NULL,NULL,'http://datamarket.azure.com',2010),(80304,NULL,'Mints mission is to help people understand and do more with their money. Mint automatically pulls all your financial information into one place. It does all the work of organizing and categorizing your spending for you.',NULL,'3900-12-21','Mint',0,NULL,NULL,NULL,NULL,'https://www.mint.com',2006),(80305,NULL,'Moodys provides credit ratings, research, tools and analysis that contribute to transparent and integrated financial markets. Moodys Corporation is the parent company of Moodys Investors Service, which provides credit ratings and research covering debt instruments and securities, and Moodys Analytics, which offers software, advisory services and research for credit and economic analysis and financial risk management.',NULL,'3900-12-21','Moodys',0,NULL,NULL,NULL,NULL,'https://www.moodys.com',1909),(80306,NULL,'Morgan Stanley is a global financial services company that provides products and services to corporations, governments, financial institutions and individuals. The company is a financial holding company that operates in three segments: Institutional Securities, Global Wealth Management Group and Asset Management. Morgan Stanley provides financial advisory and capital-raising services to a group of corporate and other institutional clients worldwide.',NULL,'3900-12-21','Morgan Stanley',0,NULL,NULL,NULL,NULL,'http://www.morganstanley.com',1935),(80307,NULL,'Morningstar provides independent investment research to investors worldwide. It offers Internet, software, and print-based products for individuals, financial advisors, and institutions. It also supplies asset-management services to advisors, institutions, and retirement-plan participants.\n\nMorningstar provides data on approximately 446,000 investment offerings, including stocks, mutual funds, and similar vehicles, along with real-time global market data on more than 10 million equities, indexes, futures, options, commodities, and precious metals, in addition to foreign exchange and Treasury markets.',NULL,'3900-12-21','Morningstar, Inc.',0,NULL,NULL,NULL,NULL,'http://www.morningstar.com',1984),(80308,NULL,'Mozio is an airport ground transportation search and booking engine and API. We partner with all the local shared-ride shuttles, airporters, taxis, limos and transit to help travelers go that final miles. Our API supports many top travel brands and allows them to upsell local ground transportation.',NULL,'3900-12-21','Mozio',0,NULL,NULL,NULL,NULL,'http://www.mozio.com/',2011),(80309,NULL,'MuckRock makes it easier to file Freedom of Information Act requests so that its clients  can focus on analyzing and reporting on the issues. MuckRock is an open government tool powered by state and federal Freedom of Information laws and you: Requests are based on your questions, concerns and passions, and you are free to embed, share and write about any of the verified government documents hosted here.',NULL,'3900-12-21','MuckRock.com',0,NULL,NULL,NULL,NULL,'https://www.muckrock.com',2010),(80310,NULL,'Munetrix is a web-based information source designed to give easy-to-understand access to financial information for municipal governments. The tool allows for building long-term financial forecasts and trend analysis including fiscal indicator scores, best-practice benchmarking and peer group comparisons.',NULL,'3900-12-21','Munetrix',0,NULL,NULL,NULL,NULL,'www.munetrix.com',2010),(80311,NULL,'The planning and zoning communities dont take a cookie-cutter approach to their products, and neither does Municode. Whether youre looking to publish a traditional zoning or land development code, a form-based code, or even a SmartCode, Municode can deliver in both online and print media. Municode is a codifier, providing a wealth of legal, editorial, and publishing services for public and private sector customers.',NULL,'3900-12-21','Municode',0,NULL,NULL,NULL,NULL,'http://www.municode.com',1951),(80312,NULL,'National Van Lines is a family-owned national moving company that provides ovide full-service moving, packing, and storage services for all our residential or commercial clients.',NULL,'3900-12-21','National Van Lines',0,NULL,NULL,NULL,NULL,'http://www.nationalvanlines.com',1901),(80313,NULL,'Nationwide provides a full range of personalized insurance and financial services, including auto insurance, motorcycle, boat, homeowners, life insurance, farm, commercial 