 We include everything we can find.\n\nSome ways we can help guard your money:\n- Choose credit cards: We help you find ones that will save you the most and give the best rewards.\n- Find deals: We help you shop smart - bargains, coupons and more.\n- Invest money: We help you avoid rip-offs and figure out where your money can stay safe and grow.\n- Stay or get healthy: We help you find affordable healthcare, from the best insurance to the best hospitals.\n- Pay for college: We help you find scholarships, calculate loans and compare colleges, including law schools and MBA programs.',NULL,'3900-12-21','NerdWallet',0,NULL,NULL,NULL,NULL,'http://www.nerdwallet.com',2009),(80318,NULL,'Mom Maps helps you find family fun places, and kid friendly locations on the go. Mom Maps allows you to search our extensive list of kids parks, kids playgrounds, kids restaurants, kids museums and kids indoor play areas, by category or zip code. In addition to a comprehensive kids play guide, youll find contact information, reviews by parents, for parents and directions. Over 32,000 locations are supported.\n\nMom Maps is unique because it enables users to tap the collective wisdom of other parents and caregivers. Locations in our extensive database are parent-recommended and include tips, reviews, photos and video so that users can find places that best suit their childs interests. Mom Maps also partners with top parent bloggers and family travel experts to map their kid-friendly recommendations.',NULL,'3900-12-21','New Media Parents',0,NULL,NULL,NULL,NULL,'http://mommaps.com/',2009),(80319,NULL,'Next Step Livings mission is to make it easy, affordable and rewarding for homeowners to implement energy-saving solutions. A one-stop resource for informed advice, expert workmanship and guidance about available incentives and rebates, Next Step Living partners with more than 400 municipalities, civic organizations and leading corporations to deliver energy-efficient and environmentally friendly solutions. Those solutions include: home energy evaluations, weatherization work (air sealing and insulation), roofing and windows, heating and cooling (ductless mini splits, HVAC systems), and solar panel installation.',NULL,'3900-12-21','Next Step Living',0,NULL,NULL,NULL,NULL,'http://www.nextstepliving.com',2008),(80320,NULL,'NextBus is a Software-as-a-Service (SaaS) solution that improves transit passengers’ lives and makes their travel experience better with accurate, real-time arrival information about buses, subways and trains. NextBus also offers travelers a host of other options including a GPS-enabled mobile website for smartphones that instantly recognizes the nearest stops in proximity order and provides real-time arrival information with multiple language capability (English, Spanish and French), and an easy-to-use website compatible with the American Disabilities Act (ADA) guidelines. The company also provides a robust set of real-time management and dispatch tools that enable transit operators to effectively manage their systems, and is a real-time transit technology leader, providing the industrys most accurate algorithm for predicting arrival times.',NULL,'3900-12-21','NextBus',0,NULL,NULL,NULL,NULL,'http://www.nextbus.com',1997),(80321,NULL,'nGAP develops and markets acquisition solutions for government and other large organizations. Their experience with government contracting requirements provides the insight needed to create the financial and operational control large organizations expect. Their solutions conform to the strict regulations that their customers are required to follow. In addition, they incorporate forms libraries so that their solutions produce outputs in formats that each agency requires and can use within their own legacy systems.\n\nnGAP developers are also experienced in integrating solutions with legacy and financial systems, thereby providing increased value and assisting customers with accomplishing their core missions. Sitting on top of our contracting and order processing functions is a comprehensive reporting capability that can house data from a multitude of systems and agencies. Using forensic and reporting tools, nGAPs customers can implement oversight objectives across and within all organizational elements.',NULL,'3900-12-21','nGAP Incorporated',0,NULL,NULL,NULL,NULL,'ngap.com',2008),(80322,NULL,'Nielsen Holdings is a global information and measurement company with positions in marketing and consumer information, television and other media measurement, online intelligence and mobile measurement.',NULL,'3900-12-21','Nielsen',0,NULL,NULL,NULL,NULL,'http://www.nielsen.com/us/en.html',1964),(80323,NULL,'Noesis Energy is an intelligent energy management platform for commercial and industrial energy professionals. Bridging the gap between people, processes and technology, our analytics tools, energy market data, educational resources and community of experts empower users – from in-house energy managers to third-party consultants – to make more informed, actionable energy management decisions.',NULL,'3900-12-21','Noesis',0,NULL,NULL,NULL,NULL,'https://www.noesisenergy.com/site/',1986),(80324,NULL,'NonprofitMetrics is an analytics website that provides business intelligence on the nonprofit sector. Our customers are financial services, accounting, and IT firms that sell to nonprofit organizations, including associations and foundations. We help our customers identify specific types of nonprofits, find relationships to these nonprofits, and stay up-to-date on market trends. To achieve this, we collect, digitize, and analyze dozens of data sources to collect massive amounts of data on nonprofits, which we then package into an easy-to-use website with powerful tools make this information meaningful and actionable.\n\nFor example, using NonprofitMetrics you can identify trade associations in the DC metro area that are growing at least 10% per year, have more than $5M in revenues, and use the Rackspace cloud to host their website. Or you can identify cultural institutions in Midwest that spend at least 5% of their budget on investment management fees. Or you can find the names and email addresses of chief finance officers at foundations whose endowments have more than $10M in corporate bonds.',NULL,'3900-12-21','NonprofitMetrics',0,NULL,NULL,NULL,NULL,'https://www.nonprofitmetrics.com',2013),(80325,NULL,'North American Van lines provides relocation solutions. It offers moving services, which include local residential or corporate, long-distance or interstate, and international moves; packing, loading/unloading, and transporting services. North American can also provide individuals with real estate and mortgage assistance through our sister relocation company.',NULL,'3900-12-21','North American Van Lines',0,NULL,NULL,NULL,NULL,'http://northamericanvanlines.com',1933),(80326,NULL,'Noveda Technologies is an provider of real-time, web-based energy and water monitoring. The company’s hardware, software and consulting services help reduce energy and water usage, optimize performance of renewable energy systems, and increase green footprint for customers across commercial/retail, industrial, government, education, and utility sectors. Noveda also offers complementary energy and water education and training programs and has a global presence, with offices in the US, UK, India and Israel.',NULL,'3900-12-21','Noveda Technologies',0,NULL,NULL,NULL,NULL,'www.noveda.com',2007),(80327,NULL,'NuCivic builds, delivers, and supports an eponymous suite of \"Open SaaS\" civic software solutions for governments and non-profit organizations worldwide. Our mission is to improve the efficacy of civic organizations and governments, by making innovative knowledge management solutions accessible at an affordable cost.\n\nNuCivic solutions are based on distributions (specialized configurations), of the Drupal CMS that runs many of the worlds most complex civic websites.  Thus, NuCivic incorporates technical innovation from more than 20,000 engineers that have contributed code to Drupal. NuCivic solutions are delivered as \"OpenSaaS\"-- turnkey hosted and supported software-as-a-service (SaaS), but still truly open-source, such that a customer can export their solution and redeploy it in their own environment at any time.\n \nOur first NuCivic product is \"NuCivic Data,\" the OpenSaaS service based on our DKAN distribution of Drupal. DKAN provides a full suite of open data cataloging, publishing and visualization features, plus rich content and community management features. DKAN is API-compatible with CKAN, the popular Python-based software widely deployed by many national governments.',NULL,'3900-12-21','NuCivic',0,NULL,NULL,NULL,NULL,'http://www.nucivic.com',2011),(80328,NULL,'NuMedii discovers and de-risks effective new drugs for specific patient subgroups by translating life sciences Big Data into therapies with a higher probability of therapeutic success.',NULL,'3900-12-21','Numedii',0,NULL,NULL,NULL,NULL,'http://numedii.com',2008),(80329,NULL,'Oliver Wyman is a leading global management consulting firm. We combine deep industry knowledge with specialized expertise in strategy, operations, risk management, and organization transformation.',NULL,'3900-12-21','Oliver Wyman',0,NULL,NULL,NULL,NULL,'http://www.oliverwyman.com/index.html',1984),(80330,NULL,'Launched in 2007, OnDeck uses data aggregation and electronic payment technology to evaluate the financial health of small and medium sized businesses and efficiently deliver capital to a market under-served by banks. Through the OnDeck platform, millions of small businesses can obtain affordable loans with a fraction of the time and effort that it takes through traditional channels. The companys proprietary credit models look deeper into the health of businesses, focusing on overall business performance, rather than the owners personal credit history. The OnDeck system also provides a critically needed mechanism for financial institutions and other business service providers to efficiently reach the Main Street small business market. \n\nOnDeck has deployed over $1 billion in capital to tens of thousands of businesses across 725 different industries. It was recently named to Forbes 100 Most Promising Companies in America list and Inc. 500/5000 for a second year in a row. The company has earned A+ rating with the BBB.',NULL,'3900-12-21','OnDeck',0,NULL,NULL,NULL,NULL,'www.ondeck.com',2007),(80331,NULL,'OnStar is a subsidiary of General Motors. It provides an in-vehicle security, communications, and diagnostics system — available on more than 50 GM models.\n\nOnStar provides vehicle-integrated safety and security solutions, value-added mobility services, and information technology services. The company provides hands-free calling, automatic crash response, stolen vehicle assistance, roadside assistance, and navigation services.',NULL,'3900-12-21','OnStar',0,NULL,NULL,NULL,NULL,'https://www.onstar.com/web/portal/home?g=1',1995),(80332,NULL,'Ontodia is an urban informatics start-up focused on enabling actionable, hyperlocalized decisions. It does this by converting raw data - taken from disparate sources - both public and private, extracting knowledge and insight.  From big data to small, actionable knowledge. It does this by using its \"crowdknowing\" technique to create Collective Knowledge Systems that leverage \"semantics, statistics, algorithm and the crowd\" to develop self-reinforcing Linked Data Networks that leverage the best of Humans and Machines to create a federated, curated Knowledge Commons, one open data city at a time.',NULL,'3900-12-21','Ontodia, Inc',0,NULL,NULL,NULL,NULL,'ontodia.com',2011),(80333,NULL,'Onvia helps businesses achieve a competitive advantage by delivering timely and actionable sales opportunities and information. Onvia offers extensive coverage of government purchasing activity in addition to commercial and residential projects in development for markets such as architecture and engineering, construction, IT/telecom, business consulting services, operations and maintenance, and transportation.\n\nOnvia tracks, analyzes and reports the spending of tens of thousands of federal, state and local government agencies, giving companies a single source for conducting open, intelligent and efficient business with government. Onvia provides an exclusive suite of integrated business tools for a wide variety of industries including Project Center with Term Contracts & Awards, Agency Center, Vendor Center and Spending Forecast Center for a wide variety of industries. Onvia also offers DemandStar, the automated system that streamlines agency procurement processes.',NULL,'3900-12-21','Onvia',0,NULL,NULL,NULL,NULL,'http://www.onvia.com',2000),(80334,NULL,'Open Data Nation (opendatanation.com) creates plug-and-play, productivity-based solutions that combine open, public data with data science techniques to increase transparency and productivity of public agencies. Open Data Nation does more than map and dashboard open data. We use open data to predict outcomes, prioritize resources, and establish data-driven performance metrics.\n\n\nOpen Data Nation is developing a suite of enterprise solutions to tackle the most pressing urban issues, by using open data science. With a click of a button, Open Data Nation’s applications suggest how to allocate resources in real-time, measures the increase speed and cost savings of data-driven decisions, and sets new performance metrics. In doing so, our solutions dynamically quantify a return on investment and isolate unexpected deviations that may signal the need for retraining or the presence of corruption. \n\n\nFor example, FIVAR (which stands for Food Inspections Violations, Anticipating Risk) uses open data to anticipate which restaurants are likely to have a health code violation (FIVAR.org). By sending inspectors to these locations first, FIVAR identifies 27% more violations, 3 days sooner, and saves an estimated $2 million, on average, each year. \n\n',NULL,'3900-12-21','Open Data Nation',0,NULL,NULL,NULL,NULL,'www.opendatanation.com',2015),(80335,NULL,'OpenCounter helps entrepreneurs to get their businesses up and running more quickly and easily by providing an online interface to the permitting process at City Hall. By making it easier for entrepreneurs to get started, OpenCounters mission is to help cities foster economic development and job creation. OpenCounter enables business owners to see the requirements, fees, and processing time that will apply to their planned use and location.\n\nOpen Counter was built through a partnership between the City of Santa Cruz, CA and Code for America in 2012.',NULL,'3900-12-21','OpenCounter',0,NULL,NULL,NULL,NULL,'http://opencounter.us',2013),(80336,NULL,'OpenGov.com builds a web-based platform for state and local government financial data. Legacy accounting systems run on computer code written thirty years ago. These enterprise tools inhibit city administrators, department heads, elected officials, and citizens from directly accessing important budget and financial data. OpenGov.com solves this pain point by offering governments a flexible, powerful software-as-a-service platform.\n\nThe OpenGov Platform provides instant access to the budget and visualizes current and historic revenue and expenses‚ from multi-year trends to object-level details. Government officials and citizens use the platform to understand, analyze, and share the financial information.\n\nComprised of technologists, Silicon Valley entrepreneurs, and government finance experts, OpenGov.com brings affordable and user-friendly financial applications to governments of all sizes. The software-as-a-service platform improves data access, financial decision-making, and builds trust with citizens.',NULL,'3900-12-21','OpenGov',0,NULL,NULL,NULL,NULL,'http://opengov.com',2012),(80337,NULL,'OpenPlans builds tools to get cities on the path to better technology, help citizens get the responsive government they should expect, and scale up small discussions to city-wide change. We are a guide to civic technology, incorporating technology, transportation and city planning, an open-source approach, and the standards knowledge necessary to deliver valuable tools to our clients.',NULL,'3900-12-21','OpenPlans',0,NULL,NULL,NULL,NULL,'http://openplans.org',1999),(80338,NULL,'OpportunitySpace collects and analyzes data about public real property - land and buildings owned by governments. We enable administrators to understand their real estate portfolios from an enterprise view. We also help the private sector and community see what real estate the government controls and why. We believe that better access to this information will accelerate the pace of redevelopment and better uses of these assets. The goal is to create higher levels of transparency, engagement and collaboration around the utilization of public real estate and to drive smarter solutions that will result in vibrant, livable communities.',NULL,'3900-12-21','OpportunitySpace, Inc.',0,NULL,NULL,NULL,NULL,'opportunityspace.org',2013),(80339,NULL,'Optensity, Inc. was founded to put the power of global scale big data, structured, unstructured and multimedia, directly into the hands of the analysts that must extract actionable information from the raw data. Optensity’s AppSymphony platform rapidly builds big data applications in the cloud, developed as a commercial product to transition our wealth of big data knowledge and experience out of the Intelligence Community and into the big data challenges of the public and private sector.\n\nAppSymphony enables data scientists and analysts to rapidly build analytic applications which execute in any type of cloud - hybrid, AWS, and all flavors of Hadoop. Existing analytics written in languages like Java, R, C++ can be migrated to Map-Reduce without writing a single line of code. AppSymphony’s ability to execute analytics at the data means it can be used for business cases such as streaming video data and sensor data streams from the internet of things. AppSymphony’s execution engine also can integrate data from heterogeneous locations and hybrid clouds.',NULL,'3900-12-21','Optensity',0,NULL,NULL,NULL,NULL,'http://www.optensity.com',2010),(80340,NULL,'Optigov is a web-based platform which allows constituencies to monitor local government spending and find governments to access the best vendors and consultants at the most reasonable cost. The express purpose of the website is to provide a market-based model to increase transparency and accountability in government contracting, limit influence of political donors and vendors on government officials, and create efficiencies in government processes, thereby creating cost savings.',NULL,'3900-12-21','optiGov',0,NULL,NULL,NULL,NULL,'optigov.com',2013),(80341,NULL,'OptumInsight (formerly Ingenix) provides analytics, technology, and consulting services to improve the performance of health systems. This UnitedHealth Group subsidiary is one of the largest US health care data companies and helps clients make accurate and cost-effective decisions about medical treatments and insurance coding, as well as where to focus their marketing strategies and research efforts to meet market needs. Its information services include database management (including electronic health records), analytics, and a variety of consulting services to health care providers, insurance firms, government agencies, and life science researchers.',NULL,'3900-12-21','OptumInsight',0,NULL,NULL,NULL,NULL,'http://www.optuminsight.com',1993),(80342,NULL,'The mission of Orlin Research, Inc., is to produce software products that multiply the power and efficiency of empirical research in the social sciences. Our goals are to expand access to complex data sources and to advance the methods of scientific investigation used to analyze them.',NULL,'3900-12-21','Orlin Research',0,NULL,NULL,NULL,NULL,'http://www.orlinresearch.com',2005),(80343,NULL,'OSIsoft delivers the PI System, the industry standard in enterprise infrastructure, for management of real-time data and events. With installations in 107 countries spanning the globe, the OSIsoft PI System is used in manufacturing, energy, utilities, life sciences, data centers, facilities, and the process industries. This global installed base relies upon the OSIsoft PI System to safeguard data and deliver enterprise-wide visibility into operational, manufacturing and business data. The PI System enables users to manage assets, mitigate risks, comply with regulations, improve processes, drive innovation, make business decisions in real-time, and to identify competitive business and market opportunities.',NULL,'3900-12-21','OSIsoft',0,NULL,NULL,NULL,NULL,'http://www.osisoft.com',1980),(80344,NULL,'OTC Markets Group Inc. operates Open, Transparent and Connected financial marketplaces for 10,000 U.S. and global securities. These securities are organized into three, tiered marketplaces (OTCQX® - The Best Marketplace with Qualified Companies; OTCQB® - The Venture Stage Marketplace with U.S. Reporting Companies; and OTC Pink® - The Open Marketplace with Variable Reporting Companies) based on the quality and quantity of information the companies make available. \n\nThis organization provides investors with the information necessary to intelligently analyze, value, and trade through any broker at the best possible price. OTC Link® ATS, an SEC-registered Alternative Trading System (ATS), directly links a diverse network of broker-dealers that provide liquidity and execution services for a wide spectrum of securities.',NULL,'3900-12-21','OTC Markets',0,NULL,NULL,NULL,NULL,'http://www.otcmarkets.com/home',1997),(80345,NULL,'Outline Systems is an Insurance Technology firm that helps Insurers grow by improving the efficiency and effectiveness of their distribution channels. Our products are developed by Insurers for Insurers. Our suite of products addresses all aspects of managing an Insurer’s Distribution workforce from getting Producers and Agency personnel onboard, cultivating relationships with your workforce that leads to deeper engagement and lastly, optimizing your compensation dollars to drive targeted payouts -- incentivizing behaviors that deliver your business objectives in a cost-effective manner.',NULL,'3900-12-21','Outline',0,NULL,NULL,NULL,NULL,'http://outline.com',2012),(80346,NULL,'Oversight Systems, Inc. is a privately-held, Atlanta-based software company whose continuous transaction monitoring solutions help Fortune 500 companies in a variety of industries solve problems related to governance, risk and compliance. Oversight’s mission is to transform operational analysis. \n\nOversight Systems works with consulting firms and business-process experts to design new Insights On Demand. Companies share with us current processes for analyzing data and generating conclusions, and we translate those processes to our Operational Analysis Platform for the automated creation of Insights On Demand.',NULL,'3900-12-21','Oversight Systems',0,NULL,NULL,NULL,NULL,'http://www.oversightsystems.com',2003),(80347,NULL,'The Student Loan Marketplace helps students find and compare private student loans from multiple lenders quickly and easily. As unique visitors to OvertureMarketplace, students complete Net Price Calculator estimates and receive personalized Shopping Sheets through our Conductor application.',NULL,'3900-12-21','Overture Technologies',0,NULL,NULL,NULL,NULL,'http://www.overturecorp.com/',2000),(80348,NULL,'Owler is a mobile and online resource that helps you follow, track, and research companies. Get real time updates and news (about your company, your competitors, your clients, your investments), hand-curated from multiple sources.',NULL,'3900-12-21','Owler',0,NULL,NULL,NULL,NULL,'owler.com',2011),(80349,NULL,'Palantir Technologies builds software platforms that help human experts perform powerful, collaborative analysis of data at scale. Palantir’s software is deployed at public institutions, private enterprises, and in the non-profit sector to address the challenges of responsibly making sense of complex, diverse data.\n\nWe currently offer a suite of software applications for integrating, visualizing and analyzing the worlds information. We support many kinds of data including structured, unstructured, relational, temporal and geospatial. Palantirs solutions are backed by our data fusion platforms: Palantir Gotham and Palantir Metropolis. \n\nOur products are built for real analysis with a focus on security, scalability, ease of use and collaboration. They are broadly deployed in the intelligence, defense, law enforcement and financial communities, and are spreading rapidly by word of mouth into applications in other industries and realms of impact.\n\nPalantir is headquartered in Palo Alto, CA with offices around the world.',NULL,'3900-12-21','Palantir Technologies',0,NULL,NULL,NULL,NULL,'https://www.palantir.com',2004),(80350,NULL,'Panjiva is a B2B platform powering the business of global trade, providing in-depth information on hundreds of thousands of suppliers from more than 190 countries. Using the platforms patent-pending algorithms and data from dozens of sources, Panjiva organizes millions of data points, extracts relevant information, combines that data with a wide variety of other data sets, and identifies patterns to present insight in a unique, user-friendly format.',NULL,'3900-12-21','Panjiva',0,NULL,NULL,NULL,NULL,'www.panjiva.com',2006),(80351,NULL,'Parsons Brinckerhoff is a global consulting firm assisting public and private clients to plan, develop, design, construct, operate and maintain thousands of critical infrastructure projects around the world. Founded in New York City in 1885, Parsons Brinckerhoff is a diverse company of 14,000 people in more than 150 offices on five continents. With a strong commitment to technical excellence, a diverse workforce, and service to our clients, we are currently at work on thousands of infrastructure projects throughout the world. These range from the mega-projects that define an entire region to smaller, more local projects that keep a community humming.',NULL,'3900-12-21','Parsons Brinckerhoff',0,NULL,NULL,NULL,NULL,'www.pbworld.com',1885),(80352,NULL,'Patently-O is primarily a media source where we provide detailed analysis of patent law issues as well as user forums.  The primary users of our system are patent law professionals.  Patently-O relies heavily on Patent Office data to provide this analysis.',NULL,'3900-12-21','Patently-O',0,NULL,NULL,NULL,NULL,'www.patentlyo.com',2004),(80353,NULL,'PatientsLikeMe is a patient network that improves lives and a real-time research platform that advances medicine. On our network, people connect with others who have the same disease or condition and track and share their own experiences. In the process, they generate data about the real-world nature of disease that help researchers, pharmaceutical companies, regulators, providers and nonprofits develop more effective products, services and care.',NULL,'3900-12-21','PatientsLikeMe',0,NULL,NULL,NULL,NULL,'http://www.patientslikeme.com',2004),(80354,NULL,'Pave is a community where individual investors unlock the potential of people early in their careers through an innovative social-financial agreement. On Pave, prospects are young, driven individuals seeking to raise funding to further their education, pay off student debt, or pursue a career opportunity, all with the goal of taking their careers to the next level. This funding comes from backers, who are accomplished individuals looking to put their success and experience to good use. Under the terms of the Pave participation agreement, prospects accept a one-time payment from backers in exchange for committing to share a small, affordable percentage of their income over a period of time (e.g., 5 to 10 years). Since backer and prospect interests are aligned, some backers may also provide career guidance, mentorship, and networking connections to promote the success of their prospects.',NULL,'3900-12-21','Pave',0,NULL,NULL,NULL,NULL,'http://www.pave.com',2012),(80355,NULL,'Paxata introduces an Adaptive Data Preparation platform built for the business analyst. Now business analysts have the ability to rapidly turn all raw data into ready data for analytics—in minutes, not months – accelerating the time to transfer insights and action in Tableau, Qlik or other BI tools.',NULL,'3900-12-21','Paxata',0,NULL,NULL,NULL,NULL,'www.paxata.com',2012),(80356,NULL,'PayScale provides compensation data for individuals and business to maximize their value. We link individuals and businesses to our large salary profile database. Use PayScale to discover what you are worth or find out how our cloud compensation software can help you to pay the right way.',NULL,'3900-12-21','PayScale, Inc.',0,NULL,NULL,NULL,NULL,'http://www.payscale.com',2001),(80357,NULL,'PeerJ is an Open Access publisher of scholarly articles that aims to drive the costs of publishing down, while improving the overall publishing experience and giving authors a publication venue suitable for the 21st Century. \n\nPeerJ publishes PeerJ (a peer-reviewed, Open Access journal) and PeerJ PrePrints (an un-peer-reviewed preprint server), both of which serve the biological, medical and health sciences.\n\nPeerJs core beliefs are to keep innovating, to remember whom we serve (i.e. the academic community) and to pass on the savings back to that community.',NULL,'3900-12-21','PeerJ',0,NULL,NULL,NULL,NULL,'https://peerj.com',2012),(80358,NULL,'People Power Company is the creator of the free app and service, \"Presence by People Power\". Presence turns your spare smartphones and tablets into free WiFi / cellular video cameras. People can use their smartphones to monitor the security of their homes while away, and to check-in on their pets, their children and their elders.',NULL,'3900-12-21','People Power',0,NULL,NULL,NULL,NULL,'http://www.peoplepowerco.com/',2009),(80359,NULL,'Persint provides an online consumer analytics application leveraging existing aggregated account data to deliver a missing component to PFM  (personal finance management) – performance conclusions. Through Persint, consumers gain the context to answer the household questions of “where do I stand” (financially) and “what next” (recommended solutions). Combining account data, peer-based exception analysis and performance scores, Persint’s analytics transform aggregated account data into objective, credible recommendations towards improving net worth, cash flow or risk management. The frictionless add-on application enables financial institutions to enhance their advisory position, gain actionable consumer intelligence and expand revenue opportunities. Becoming their advisor requires delivering objective advice.',NULL,'3900-12-21','Persint',0,NULL,NULL,NULL,NULL,'http://www.persint.com/',2012),(80360,NULL,'Personal Democracy Media (PDM) is an independent media company focused on the intersection of politics and technology.\n\nPersonal Democracy Media produces the annual Personal Democracy Forum (PDF) conference, now in its 11th year. It also publishes the award-winning news site, techPresident.com.\n\nwww.personaldemocracy.com serves as a hub for the conversation already underway between political practitioners and technologists, as well as anyone invigorated by the potential of all this to open up the process and engage more people in all the things that we can and must do together as citizens.',NULL,'3900-12-21','Personal Democracy Media',0,NULL,NULL,NULL,NULL,'http://personaldemocracy.com',2004),(80361,NULL,'Personal is a digital vault and private networking service for individuals to securely manage their important data and files, including for auto form-filling on web and mobile. Called a “life-management platform” by The Economist, Personal is available through individual annual subscriptions and partners (companies, organizations and government) that provide vaults co-branded with Personal to their own customers and users. Partner vaults are pre-filled with information that the partner holds about the individual and that is instantly useful for access across devices, auto form-filling, and private, secure sharing. Built on a privacy- and security-by-design platform, Personal gives people control and portability over their information, all with the peace of mind that the copy in their vault remains legally theirs, it cant be shared without their permission, and they can stop access at any time.',NULL,'3900-12-21','Personal, Inc.',0,NULL,NULL,NULL,NULL,'personal.com',2009),(80362,NULL,'Personalis is a contract research organization and genome-scale diagnostics services company pioneering genome guided medicine. We are focused on producing the most accurate genetic sequence data from each sample, and using our analytics and proprietary content to draw accurate and reliable biomedical interpretations of the data. Our tests are based on whole human genome and exome sequencing, conducted in our own laboratory. We utilize proprietary databases, advanced human reference sequences, and sophisticated algorithms to analyze results. We currently offer service for research use only, but aim to enter the clinical diagnostics market; our in-house laboratory is CLIA-licensed by the state board of California and CAP accreditation is in progress.',NULL,'3900-12-21','Personalis',0,NULL,NULL,NULL,NULL,'http://www.personalis.com',2011),(80363,NULL,'Petersons provides an integrated suite of products and services that are designed to assist students and families in the planning and preparation for college/career/military, while simultaneously serving as a conduit to match such students with the best possible choice from an academic, social, and/or financial fit perspective.',NULL,'3900-12-21','Petersons',0,NULL,NULL,NULL,NULL,'www.corporate.petersons.com',1966),(80364,NULL,'PEV4me.coms first application, the PEV calculator, enables prospective electric vehicle owners to estimate their total electricity bill when adding a home electric vehicle charger to their existing home electricity needs. The calculator compares multiple rate plans offered by a user’s local utility company to determine the most cost effective plan based on the user’s existing driving needs as well as his or her past home electricity usage using Green Button data. In addition, the app calculates the annual cost savings of replacing an internal combustion engine (ICE) vehicle, or gas powered car, with a plug-in electric car.',NULL,'3900-12-21','PEV4me.com',0,NULL,NULL,NULL,NULL,'http://www.pev4me.com',2011),(80365,NULL,'PIXIA Corp is a commercial software company that promotes information-sharing by providing high-performance data access for large data sets. Our technology excels at petabyte+ volumes of data. As raster datasets grow, they become increasingly difficult to store, access, utilize and share. This is where PIXIA comes in. We make the storing and exchanging of information more efficient, less taxing on architectures, improves workflows of users and enables first-ever sharing of homogeneous data stored in closed architectures (stovepipes). \n\nPIXIA® provides solutions for the efficient delivery of geospatial data, motion imagery and video in a cloud-based, service-oriented architecture while promoting and adhering to internationally-recognized open standards. We apply these solutions to data access and management challenges faced by the U.S. Government defense and security sectors. Our technology has enabled the government to share and exchange information providing unprecedented data access to a wide variety of large, heavy data sets in various bandwidth environments without changing hardware, software architectures or modifying viewing devices.',NULL,'3900-12-21','PIXIA Corp',0,NULL,NULL,NULL,NULL,'www.pixia.com',1999),(80366,NULL,'When deciding where to live you need to take a lot into account. So you want everything you need to know at the right time at the right place. You don’t like any unexpected surprises; you want to be sure that your new home is the best there ever was. We like that too. That’s why we started PlaceILive.com.\n\n-	PlaceILive gives you all the information on any house and neighborhood in our five cities.\n-	Through our Life Quality Index you can easily compare which one is best.\n-	Learn from the real life experiences of existing community members.\n-	Make easier and better decisions \n\nPlaceILive.com is here to become the most authoritative source on neighborhood data worldwide.  We do that by presenting you the best information through an easy to use interface.\n',NULL,'3900-12-21','PlaceILive.com',0,NULL,NULL,NULL,NULL,'www.placeilive.com',2012),(80367,NULL,'PlanetEcosystems (PEI) helps utility service providers and others develop deep and engaging relationships with consumers of utility services, and substantially increases the actual and perceived value of the services received by consumers. With its P-ECOSYS technology platform, PEI provides a complete suite of interactive web-based tools, including a proprietary utility system optimization technology that can deliver consumers tens of thousands of dollars in net cumulative savings, and highly valuable project management and social engagement capabilities.',NULL,'3900-12-21','PlanetEcosystems',0,NULL,NULL,NULL,NULL,'http://planetecosystems.com',2009),(80368,NULL,'PlotWatt shows people how to reduce their electricity bills by analyzing smart meter data to identify sources of energy waste. Our proprietary algorithms compute appliance-level energy cost without monitoring the individual appliances. The PlotWatt recommendation engine then generates customized, quantified recommendations tailored to each user’s home.',NULL,'3900-12-21','PlotWatt',0,NULL,NULL,NULL,NULL,'https://plotwatt.com',2008),(80369,NULL,'Plus-U matches students to colleges based on education, career and financial goals.',NULL,'3900-12-21','Plus-U',0,NULL,NULL,NULL,NULL,'https://www.unigo.com/from-plusu.aspx',2008),(80370,NULL,'PolicyMap is a national online mapping tool, and is a division of The Reinvestment Fund, a Community Development Financial Institution. PolicyMap grew out of our underwriting departments need for good data with which to make good lending decisions. With around 1500 subscribers and 25,000 registered users, we launched in December 2007 and have been growing ever since, adding new features and products to our list of offerings.  We provide our main mapping tool, PolicyMap.com, along with an API, a data licensing service, university site licenses, and mapping widgets for our clients to use on their own websites. We offer over 20,000 indicators, many of which are from the Census, the Bureau of Labor Statistics, and the Consumer Financial Protection Bureau. Our subscribers include organizations and companies in banking, real estate, govt, education, non-profit, philanthropy and the media.',NULL,'3900-12-21','PolicyMap',0,NULL,NULL,NULL,NULL,'policymap.com',2007),(80371,NULL,'Politify is a platform that provides Americans with data-backed financial projections of political scenarios. We employ a direct, mathematical reading of political material, breaking down cumbersome policies into bite-sized chunks. Politify is setting out to solve one of the oldest problems in democracy: which candidate best serves our individual interests?',NULL,'3900-12-21','Politify',0,NULL,NULL,NULL,NULL,'http://www.politify.us',2011),(80372,NULL,'Poncho is an app that delivers personalized weather reports every morning, tailored to your routine, delivered by email or text.',NULL,'3900-12-21','Poncho App',0,NULL,NULL,NULL,NULL,'http://poncho.is/',2013),(80373,NULL,'POPVOX is a civic engagement platform that meshes real-time legislative data with users personal stories and sentiment. POPVOX curates and delivers public input to government in a format tailored to actionable policy decisions.\n\nPOPVOX is organized as a \"civic startup\", a for-profit corporation with a dual mission to scale and return value to investors while empowering individuals and making government more accountable.\n\nPOPVOX Pro provides a collection of grassroots advocacy tools for organizations of any size to mount a significant legislative campaign, harnessing the power of targeted grassroots action. Advocacy organizations, trade associations, and corporations pay a monthly fee for POPVOX widgets, enabling networks to write Congress through embedded POPVOX tools, displaying dynamic legislative content.',NULL,'3900-12-21','POPVOX',0,NULL,NULL,NULL,NULL,'popvox.com',2010),(80374,NULL,'Porch has developed a data driven home improvement network – free for homeowners and professionals. With over 1.5 million professionals and over 90 million projects in their network, Porch enables consumers to make smart home improvement decisions by connecting them with the right professionals. Porch helps professionals grow their business and succeed as more homeowners look online for trusted professionals to complete their projects.',NULL,'3900-12-21','Porch',0,NULL,NULL,NULL,NULL,'porch.com',2012),(80375,NULL,'PossibilityU delivers an online blended college counseling program, designed specifically for high school students and their families, but led by your schools professional counseling staff. Our goal is simple; in partnership with your counselors, to enable students and parents to: Find the Right College - Get In - Get Aid. \n\nWe combine big data about colleges, a counselor-designed curriculum and a powerful recommendation engine to personalize each students path to the college where they will thrive - academically, socially and financially. ',NULL,'3900-12-21','PossibilityU',0,NULL,NULL,NULL,NULL,'