y it’s late if it’s not there.  Roadify has the scale to provide information for public signage at transit hubs and elsewhere—including Brooklyn’s Barclays Center, New York’s City 24x7 kiosks and the Philadelphia Convention Center.  Roadify has strategic relationships with Cisco and Veolia Transportation around data management and content distribution.\n\nRoadify’s model is simple:\n\n<br>1. Aggregate open real-time arrival, advisory and schedule data from transit agencies with tweets and comments from users. Distribute this content: i) through partner networks on a localized basis, such as sports and entertainment venues, hotels, retailers, outdoor display, websites and other mobile apps and ii) through our own mobile app </br>\n<br>2. Build a global user base by addressing a daily, chronic, universal information need—“when is my ride coming and why is it late?”</br>\n<br>3. Make it easy for 1) venues and enterprises to display this content paid for by subscription fees and 2) riders to book multi-mode urban ground transportation services from our app and partners</br>',NULL,'3900-12-21','Roadify Transit',0,NULL,NULL,NULL,NULL,'www.roadify.com',2010),(80411,NULL,'Robinson + Yu is a technology policy consulting firm. We help our clients harness Internet technologies to address civic problems. Among our projects, we have worked with the telecommunications ministry of a developing country to advance its open government data efforts, and with a Fortune 100 technology company to study innovations at the intersection of technology and governance. Our toolbox spans policy and law, software engineering, and advanced computer science techniques.',NULL,'3900-12-21','Robinson + Yu',0,NULL,NULL,NULL,NULL,'http://www.robinsonyu.com',2011),(80412,NULL,'Russell Investments is a global asset manager working with institutional clients, independent distribution partners and individual investors to achieve their financial goals. We offer actively managed multi-asset portfolios and services that include advice, investments and implementation. \n\nRussell also serves as a consultant to some of the largest pools of capital in the world. Our services – delivered to institutional clients, financial intermediaries and individual investors – extend across capital market insights, manager research, portfolio construction, portfolio implementation and indexes. \n\nWe calculate approximately 700,000 benchmarks daily, which cover 98% of the investable market globally. Approximately $4.1 trillion in assets are benchmarked to our Russell Indexes.',NULL,'3900-12-21','Russell Investments',0,NULL,NULL,NULL,NULL,'http://www.russell.com/indexes/',1936),(80413,NULL,'At Sage Bionetworks, we work to redefine how complex open biological data is gathered, shared and used. Our work includes the building of platforms and services and undertaking research developing predictors relating to health. Arising in 2009 from a donation by Rosetta Inpharmatics (Merck Inc), we are a non-profit research organization based in Seattle, US and collaborate with a worldwide network. \n\nWe create technology platforms that facilitate collaboration on data, governance platforms that enable data sharing and reuse, run challenges to solve complex biomedical problems, perform our own cutting-edge computational biology and research, and run large-scale clinical observational studies of health.',NULL,'3900-12-21','Sage Bionetworks',0,NULL,NULL,NULL,NULL,'http://sagebase.org',2009),(80414,NULL,'SAP is a software company developing enterprise resources planning and business objects software. It provides enterprise software and software-related services to companies in more than 26 industries.',NULL,'3900-12-21','SAP',0,NULL,NULL,NULL,NULL,'http://www.sap.com/',1972),(80415,NULL,'SAS provides advanced analytics and data management software and services, and is a large independent vendor in the business intelligence market. SAS helps organizations anticipate business opportunities, empower action