ion and quality recognition within an open marketplace. Service providers are government funded core facilities and university labs, which have difficulty in promoting services for external use, and tracking impact of services. Science Exchange helps researchers find the facilitys services in a centralized platform, and increase utilization of labs that are running below capacity. The platform also allows for tracking of all work performed, and publications resulting from work performed on the site with collaborates - making management and reporting of service labs easier.',NULL,'3900-12-21','Science Exchange',0,NULL,NULL,NULL,NULL,'scienceexchange.com',2011),(80418,NULL,'Seabourne makes it possible to use information stored in a range of different databases and technologies to gain new insights, get new value from legacy data systems, improve decision making and power new products.',NULL,'3900-12-21','Seabourne',0,NULL,NULL,NULL,NULL,'www.seabourneinc.com',2010),(80419,NULL,'SeeClickFix is a communications platform for residents to report non-emergency issues, and governments to track, manage, and reply. We aim to improve communities through transparency, collaboration, and cooperation. They say all politics is local. While were not political, we do believe that the changes that have a real impact on our daily lives occur at the block, neighborhood, or city level. Its our goal to provide the best tools for residents and governments to communicate; regardless of size, population, and budget. SeeClickFix could not exist without the support of an amazing community of volunteers, residents, and government staff. This community, which is passionate about everything civic, makes our mission possible every day.',NULL,'3900-12-21','SeeClickFix',0,NULL,NULL,NULL,NULL,'en.seeclickfix.com',2008),(80420,NULL,'SigFig provides an easy way to manage and improve your investments. We track individuals financial assets and provides detailed visualizations of their investments and re