ate customers and weed out scammers, cutting verification costs and improving the user experience.',NULL,'3900-12-21','TowerData',0,NULL,NULL,NULL,NULL,'http://intelligence.towerdata.com/',2006),(80475,NULL,'TransparaGov helps state and local governments improve their management processes. We do this by providing analytical, management, and outcomes measurement software and services to the 93,000 units of state and local government that wrestle with issues such as compliance, performance, fraud and abuse, accountability, and transparency as they implement a wide variety of public projects and programs.\n\nWe provide consulting services to create custom tailored software-centric solutions that make it easy for state and local governments to add (1) accountability and compliance management, (2) performance monitoring, (3) fraud and abuse controls, and (4) transparency-focused reporting capabilities to the public projects and programs they implement. ',NULL,'3900-12-21','TransparaGov',0,NULL,NULL,NULL,NULL,'http://www.TransparaGov.com/',2011),(80476,NULL,'TransUnion is a global provider of credit and information management. The company leverages its understanding of consumer information, advanced analytic capabilities, sophisticated technologies and diverse expertise to develop innovative and reliable solutions to meet the changing needs of customers and consumers.',NULL,'3900-12-21','TransUnion',0,NULL,NULL,NULL,NULL,'http://www.transunion.com/',1968),(80477,NULL,'Trialtrove is a comprehensive real-time source of pharmaceutical clinical trials intelligence, gathering clinical trial information from over 30,000 clinical trial data sources to provide a continually updated reference of clinical trials research in more than 150 countries. Covering over 180 diseases in eight major therapeutic areas, it is a real-time service offering a wide breadth and depth of clinical trial data, supported by experienced pharmaceutical industry analysts.',NULL,'3900-12-21','TrialTrove',0,NULL,NULL,NULL,NULL,'http://www.citeline.com/products/trialtrove/',2002),(80478,NULL,'TrialX is an online platform that empowers patients to find clinical trials that match their health conditions and connect with the trial investigators effortlessly. TrialX includes a novel decision engine, Ask Dory  that uses as an entropy-based algorithm to find the most appropriate matching trials as quickly as possible. Dory also works as a personal assistant, connecting patients to matching site in real-time (using a cloud-based phone network). And she is warm and friendly to work with.\n\nTrialX is available on the web (TrialX.com), as an iPhone app and is integrated with HealthVault, a personal health record platform. The Enterprise version of TrialX powers clinical trial search at leading academic medical centers such as the Beth Israel Deaconess Medical center, University of Pennsylvania, NewYork Presbyterian Hospital, New York University and patient advocacy groups such as the Multiple Myeloma Research Foundation.',NULL,'3900-12-21','TrialX',0,NULL,NULL,NULL,NULL,'http://trialx.com/',2007),(80479,NULL,'Trintech is a leading provider of financial software for the Record-to-Report Process. Its main products are Cadency and ReconNet. \n\nCadency is a financial governance solution that weaves all R2R activities into a single, seamless process including account reconciliation, compliance and disclosure management/financial reporting, all while providing total control over the financial close and journal entry processes. Trintechs ReconNET, automates over 90% of your operational bank reconciliations, high-volume transaction matching and exception management processes. ReconNET streamlines your workflow so you can deploy resources to other areas critical to your business. \n\nTrintech’s offices are located in the United States, United Kingdom, Australia, Netherlands, France and Ireland, with partners in South Africa, Latin America and across the Asia Pacific region.',NULL,'3900-12-21','Trintech',0,NULL,NULL,NULL,NULL,'http://www.trintech.com/',2000),(80480,NULL,'TrueCars mission is to make the car-buying process simple, fair and fun. Achieving this goal begins with analyzing the most accurate, timely and comprehensive pricing information available. Then making it easy to understand and available; free of charge. This kind of pricing information will allow you to recognize a fair price based on what others actually paid. The result: consumers and dealers have a guide that helps them establish a baseline of trust and the parameters of a fair deal.',NULL,'3900-12-21','TrueCar',0,NULL,NULL,NULL,NULL,'http://www.truecar.com/',2005),(80481,NULL,'Trulia is an all-in-one real estate site that gives you the local scoop about homes for sale, apartments for rent, neighborhood insights, and real estate markets and trends to help you figure out exactly what, where, and when to buy, sell, or rent. You can also find a real estate agent, view prices of recently sold homes, and see home values in your community. Trulia also allows you to get advice and opinions from local real estate agents, brokers, and other local experts on Trulia Voices, its online real estate community.',NULL,'3900-12-21','Trulia',0,NULL,NULL,NULL,NULL,'trulia.com',2005),(80482,NULL,'TrustedID provides identity theft solutions for consumers. The companys flagship product, IDEssentials, offers comprehensive, proactive safeguards against identity theft as well as three bureau credit monitoring, scores and reports. TrustedID also offers employee benefits programs and data breach response solutions for companies and organizations.',NULL,'3900-12-21','TrustedID',0,NULL,NULL,NULL,NULL,'https://www.trustedid.com/',2005),(80483,NULL,'TuvaLabs aims to make open data useful in the context of education by offering teachers, parents, and students a platform and tools to engage in meaningful learning around their favorite real-world topics. We have created a platform for students to be able to visualize, analyze, and interpret their favorite data sets. We believe that analyzing data, spotting patterns, and extracting useful information have become gateway skills for future STEM jobs, to full participation in the workforce, and civic engagement in 21st century.',NULL,'3900-12-21','TuvaLabs',0,NULL,NULL,NULL,NULL,'https://www.tuvalabs.com/',2012),(80484,NULL,'Uber aims to evolve the way the world moves: by seamlessly connecting riders to drivers through our apps, we make cities more accessible, opening up more possibilities for riders and more business for drivers. Operating in over 50 cities today, Ubers rapidly expanding global presence continues to bring people and their cities closer.',NULL,'3900-12-21','Uber',0,NULL,NULL,NULL,NULL,'https://www.uber.com/',2009),(80485,NULL,'Unigo.com is a resource for prospective college students and parents looking for authentic information about the schools they’re considering. The site features tens of thousands of reviews, photos, videos and articles from America’s top colleges, provided by the real experts - the students who attend them.',NULL,'3900-12-21','Unigo LLC',0,NULL,NULL,NULL,NULL,'www.unigo.com',2008),(80486,NULL,'United Mayflower Container Services operates in the portable storage container industry. It provides local and long-distance moving and storage services in more than 50 of the largest markets in the United States. Services are delivered through a nationwide-network of dealers. United Mayflower Container Services is a subsidiary of UniGroup, a leader in the transportation industry and parent company to Mayflower Transit and United Van Lines.',NULL,'3900-12-21','United Mayflower',0,NULL,NULL,NULL,NULL,'http://www.unitedmayflower.com/',2006),(80487,NULL,'Urban Airship offers Mobile Relationship Management (MRM) solutions that enable brands and marketers to earn and maintain a presence on their customers’ mobile devices in order to build brand awareness, engage users, drive conversions and increase customer loyalty. Its cross-platform solutions manage the end-to-end process of delivering customer- and location-targeted mobile push messages, Apple Passbook passes and Google Wallet cards, including consulting services and analytics to optimize effectiveness.',NULL,'3900-12-21','Urban Airship',0,NULL,NULL,NULL,NULL,'http://urbanairship.com/',2009),(80488,NULL,'Urban Mapping offers embedded geographic technology, meaning a web-first approach to delivering geo-intelligence. This means offering spatial operations (create maps, generate reports, etc...) using our on-demand collection of data, which includes over 10,000 variables.\n\nBecause the Mapfluence platform brings together web mapping with an integrated collection of high-value data, developers/organizations can quickly develop solutions that are relevant for their needs. We have expertise in data transformation and maintain an active data sourcing group which works independent of our core visualization/analytic engine.',NULL,'3900-12-21','Urban Mapping, Inc',0,NULL,NULL,NULL,NULL,'http://www.urbanmapping.com/',2006),(80489,NULL,'U.S. Green Data (USGD) develops products that catalyze investment in energy development and efficiency by building innovative tools that change how the world receives and understands energy information. We enable firms to view all energy efficiency and renewable energy incentives, rebates, tax credits, and policies available to a specific address, zip code, or across a portfolio of multiple locations. \n\nUSGD provides accurate, fast, and easy-to-use analytical tools which allow organizations to access, sort, and apply for large no-cost government funds for themselves or their customers. Whether your organization wants to be greener, improve project management and streamline purchasing, utilize rebates during normal maintenance and upgrades, or drive value and sales to your customers, USGD provides you with information that can make a significant impact on your firm’s bottom and top lines.',NULL,'3900-12-21','US Green Data',0,NULL,NULL,NULL,NULL,'http://www.usgreendata.com/',2010),(80490,NULL,'U.S. News publishes annual print and e-book versions of its authoritative rankings of Best Colleges, Best Graduate Schools and Best Hospitals. In 2012 U.S. News launched a conference division focusing on important national conversations and solutions in STEM Education and Hospitals of Tomorrow.',NULL,'3900-12-21','U.S. News Schools',0,NULL,NULL,NULL,NULL,'http://www.usnews.com/',1983),(80491,NULL,'USAA Groups mission is to facilitate the financial security of its members, associates, and their families through provision of a full range of highly competitive financial products and services; in so doing, USAA seeks to be the provider of choice for the military community.',NULL,'3900-12-21','USAA Group',0,NULL,NULL,NULL,NULL,'https://www.usaa.com',1922),(80492,NULL,'US Search has pioneered the concept of providing information about people via the Internet in the United States. US Searchs technology has helped customers locate hard-to-find friends, relatives and others. Beyond providing current addresses and phone numbers, US Search helps customers gain peace of mind regarding other individuals through background checks, criminal records and more.',NULL,'3900-12-21','USSearch',0,NULL,NULL,NULL,NULL,'http://www.ussearch.com/',1994),(80493,NULL,'Verdafero is a SaaS software and services provider helping businesses save money and increase profit. \n\nOur unique cloud-based software platform brings immediate resource and cost savings to organizations with multiple facilities and utilities.\n\nVerdafero provides an inexpensive online solution that gives the user an easy to use, in-depth, value based examination and view of their utility expenses and usage. It provides direct feedback on projects and initiatives to help reduce usage and directly increase profit across multiple facilities and locations all in a simple, easy to use interface at the click of a button.',NULL,'3900-12-21','Verdafero',0,NULL,NULL,NULL,NULL,'www.verdafero.com',2009),(80494,NULL,'Vimo designs, operates, and sells online shopping portals for health-insurance plans. Its portal enables small businesses and families to research, rate, and purchase health care products and services, such as insurance, health savings accounts, medical procedures, doctors, and dentists. The company’s portal also enables patients to compare prices for surgical procedures at hospitals in the United States.',NULL,'3900-12-21','Vimo',0,NULL,NULL,NULL,NULL,'www.vimo.com',2012),(80495,NULL,'VisualDoD is a subscription-based service and web-based platform for customers who want to take a strategic approach to understanding and forecasting US defense market spending. Using it improves quality, enhances productivity, and cuts costs for corporate, government and professional services clients working in the defense market. Founded by a nation-wide team that knows the Defense Department, strategic planning, market assessments, and software development, VisualDoD has clients in government, defense industry and professional services, including OSD, the US Army, Lockheed, Boeing, Raytheon, Northrop Grumman and McKinsey And Co.',NULL,'3900-12-21','VisualDoD, LLC',0,NULL,NULL,NULL,NULL,'www.visualdod.com',2012),(80496,NULL,'Niinja was created to improve transparency in the world of government contracting by encouraging competition. Niinja assists current and prospective government suppliers by answering the following questions: \n\nWhich agency or military branch buys products like this? \nWhich competitors provide similar products? \nWhat is the selling price? \n\nWith 6.8 million items stocked by the Defense Department and 2.6 million supplier companies in the database, Niinja facilitates public transparency of military spending data to promote competition in the federal logistics market, specifically encouraging small business participation.',NULL,'3900-12-21','Vital Axiom | Niinja',0,NULL,NULL,NULL,NULL,'niinja.co',2012),(80497,NULL,'VitalChek is an official provider of online services for hundreds of government agencies nationwide, safely delivering millions of important documents every year.',NULL,'3900-12-21','VitalChek',0,NULL,NULL,NULL,NULL,'https://www.vitalchek.com/',1987),(80498,NULL,'Vitals.com offers tools powered by data and patient insight that help people find the right doctor and prepare for upcoming appointments. For health plans, Vitals powers an end-consumer transparency and engagement platform that enables members to decide on providers and procedures based on quality and cost information. For doctors and hospitals, Vitals’ solutions help providers attract patients and grow their market share.',NULL,'3900-12-21','Vitals',0,NULL,NULL,NULL,NULL,'http://www.vitals.com/',2007),(80499,NULL,'Vizzuality is a small development company based in Madrid and New York City. We have two branches of development, consulting and the development of our flagship product, CartoDB. We enjoy being a small and productive company that delivers great user experiences and helps to tell stories that matter. We have been trying to make the world better since 2007. In this time we have worked with some of the biggest conservation organizations on more than 20 projects. Our development of CartoDB arose from our work as consultants when we realized the need to tell stories with beautiful maps was greater than what our company could enable without such a product.',NULL,'3900-12-21','Vizzuality',0,NULL,NULL,NULL,NULL,'vizzuality.com',2011),(80500,NULL,'Votizen is a web service that allows you to discover how your friends on social networks are registered to vote, and campaign with them to elect candidates that share your values.',NULL,'3900-12-21','Votizen',0,NULL,NULL,NULL,NULL,'www.votizen.com',2010),(80501,NULL,'Walk Score makes it easy for apartment renters and homebuyers to find neighborhoods where they can drive less and live more. Walk Score believes that walkable neighborhoods with access to public transit, shorter commutes, and proximity to the people and places you love are the key to a happier, healthier and more sustainable lifestyle. Walk Score delivers more than 9 million scores for apartment and home addresses per day across a network of more than 15,000 real estate sites. To find your Walk Score, enter your address at http://www.walkscore.com.',NULL,'3900-12-21','Walk Score',0,NULL,NULL,NULL,NULL,'www.walkscore.com',2007),(80502,NULL,'WaterSmart Software helps water utilities engage with their customers to save water and money. WaterSmart deploys a turnkey, cloud-based platform for water utilities that employs sophisticated data analytics and behavioral science tools to reduce residential water demand. The solution is proven to reduce water consumption by up to 5%, and improve customer satisfaction by nearly 200%.',NULL,'3900-12-21','WaterSmart Software',0,NULL,NULL,NULL,NULL,'http://www.watersmartsoftware.com/',2009),(80503,NULL,'WattzOn is a personal energy management platform that helps people save money, save energy and go green. WattzOns technology combines propriety data and analytics and best-of-breed scientific research to deliver customized energy assessments that instantly identify 20 percent or more in savings for the average consumer.',NULL,'3900-12-21','WattzOn',0,NULL,NULL,NULL,NULL,'http://www.wattzon.com/',2008),(80504,NULL,'Way Better Patents is a digital pulse of the patentsphere chronicling the latest developments in intellectual property, innovation, inventions and patents (I3P) and the emerging innovation economy. Aimed at the new generation of self-directed digital native inventors, innovators, investors, and entrepreneurs, it illuminates the issues and players of the nations patent-focused businesses, offering a real-time narrative on patents, patent business models, patent policy and patent data in an expressive and easy to understand way.',NULL,'3900-12-21','Way Better Patents',0,NULL,NULL,NULL,NULL,'http://waybetterpatents.com/',2012),(80505,NULL,'Through The Weather Channel, weather.com, Weather Underground, Intellicast.com and third-party publishing partners, the company provides millions of people every day with weather forecasts, content and data, connecting with them through television, online, mobile and tablet screens. Through WSI and Weather Central, the company delivers professional weather services for the media, aviation, marine and energy sectors.',NULL,'3900-12-21','Weather Channel',0,NULL,NULL,NULL,NULL,'http://www.weather.com/',1982),(80506,NULL,'Weather Decision Technologies provides organizations with decision support on a global scale. WDT offers specific expertise with big data as it applies to hazardous weather detection and prediction, forecast modeling, decision analytics, GIS, mobile apps and interactive mapping. WDT employs the WeatherOps forecast team, staffed by experts who provide global asset projection and commodities trading decision support.',NULL,'3900-12-21','Weather Decision Technologies',0,NULL,NULL,NULL,NULL,'http://www.wdtinc.com/',1999),(80507,NULL,'Weather Underground provides free, real-time online weather information to users, as well as a variety of Newspaper Weather Services and Custom Site Weather Packages.',NULL,'3900-12-21','Weather Underground',0,NULL,NULL,NULL,NULL,'http://www.wunderground.com/',1995),(80508,NULL,'WebFilings aims to reinvent business reporting. The company provides cloud-based collaboration solutions to eliminate version control issues for the most important and challenging reports, including external filings. \n\nWdesk uses role-based access to single document datamodel technology, improving speed to review and approve. Sophisticated linking and validation features reinforce accuracy and compliance throughout the reporting process. Wdesk is secure and enables professionals to take control of their business reporting data.',NULL,'3900-12-21','WebFilings',0,NULL,NULL,NULL,NULL,'https://www.webfilings.com/',2008),(80509,NULL,'Webitects is a web design, design research, and software development consultancy that has been a major sponsor and participant in Chicagos growing open data movement. Websites involving open civic data include areas of political transparency, crime and criminal justice reform, education, and sustainability.',NULL,'3900-12-21','Webitects',0,NULL,NULL,NULL,NULL,'webitects.com',1998),(80510,NULL,'WebMD is a provider of health information and services to consumers and healthcare professionals. The online healthcare information, decision-support applications and communications services that we provide help consumers take an active role in managing their health by providing objective healthcare information and lifestyle information. We make it easier for physicians and healthcare professionals to access clinical reference sources, stay abreast of the latest clinical information, learn about new treatment options, earn continuing medical education credits and communicate with peers. We also enable employers and health plans to provide their employees and plan members with access to personalized heath and benefit information and decision support technology that helps them make informed benefit, provider and treatment choices.',NULL,'3900-12-21','WebMD',0,NULL,NULL,NULL,NULL,'http://www.webmd.com/',1996),(80511,NULL,'Weight Watchers is an international company based in the United States that offers various products and services to assist weight loss and maintenance.',NULL,'3900-12-21','Weight Watchers',0,NULL,NULL,NULL,NULL,'http://www.weightwatchers.com/',1960),(80512,NULL,'WeMakeItSafers mission is to dramatically reduce the number of product-related injuries, illnesses and deaths that occur each year worldwide. In so doing, we not only save lives, we help to build stronger, more socially responsible and financially stable companies.',NULL,'3900-12-21','WeMakeItSafer',0,NULL,NULL,NULL,NULL,'http://wemakeitsafer.com/',2009),(80513,NULL,'Wheaton World Wide Moving is a premier provider of transportation services - from residential household goods relocation to corporate transferees. In addition, Wheaton has full service divisions that address furniture, fixture and equipment for the hospitality industry as well as a full service logistics.',NULL,'3900-12-21','Wheaton World Wide Moving',0,NULL,NULL,NULL,NULL,'http://www.wheatonworldwide.com/',1945),(80514,NULL,'At the Whitby Group, we work on diverse toilet-related challenges. With our deep expertise in ergonomics, sanitation, technology history and engineering, we solve problems and attack challenges from all sides.',NULL,'3900-12-21','Whitby Group',0,NULL,NULL,NULL,NULL,'http://www.whitbygroup.com',2001),(80515,NULL,'Wolfram Research is a respected computer, web, and cloud software company —as well as a powerhouse of scientific and technical innovation. Our mission is to pursue our long-term vision to develop the science, technology, and tools to make computation an ever-more-potent force in todays and tomorrows world.',NULL,'3900-12-21','Wolfram Research',0,NULL,NULL,NULL,NULL,'http://www.wolfram.com/',1987),(80516,NULL,'Wolters Kluwer is a leading global information services and solutions company. We provide information, software, and services that help legal, tax, finance, and healthcare professionals make critical decisions effectively and with confidence. We help our customers move through the complex layers of data and regulation that define modern business and government.',NULL,'3900-12-21','Wolters Kluwer',0,NULL,NULL,NULL,NULL,'http://www.wolterskluwer.com/',1836),(80517,NULL,'WorkHands is a free community where workers in the trades can show off what theyre great at, connect with jobs and coworkers, find tools and equipment, display licenses, and more.  It is a meeting place for the American workers who build, maintain, fix, and haul, heroes who spend their days getting their hands dirty to make our country run. WorkHands is where you can show off what youre capable of building, fixing, maintaining, and hauling.',NULL,'3900-12-21','Workhands',0,NULL,NULL,NULL,NULL,'https://www.workhands.us/',2012),(80518,NULL,'Xatori is a technology company focused on building innovative software for connected cars and an enlightened electricity grid.',NULL,'3900-12-21','Xatori',0,NULL,NULL,NULL,NULL,'http://www.xatori.com/',2010),(80519,NULL,'Xcential aims to make law more transparent and accessible. We work with legislatures around the world to structure and digitize legislation.  Clients include the State of California, the U.S. House of Representatives, Chile and Hong Kong. With structured legislative data as a basis, we are providing transparent, user-friendly legal research resources for government and the public.',NULL,'3900-12-21','Xcential',0,NULL,NULL,NULL,NULL,'xcential.com',2003),(80520,NULL,'xDayta is a marketplace to buy and sell data. xDayta users can sell data at a price they set and get paid instantly through PayPal. Users can buy data with PayPal and download purchased data instantly. We connect data buyers and sellers.',NULL,'3900-12-21','xDayta',0,NULL,NULL,NULL,NULL,'http://www.xdayta.com',2013),(80521,NULL,'Xignite is a provider of market data cloud services. The company’s market data cloud fulfills more than five billion service requests per month and offers more than 60+ financial web services providing real-time, historical and reference data for global equities, commodities, currencies, options, fixed income, mutual funds, derivatives and over-the-counter (OTC) instruments.',NULL,'3900-12-21','Xignite',0,NULL,NULL,NULL,NULL,'http://www.xignite.com/',2000),(80522,NULL,'Yahoo! Inc. is a global Internet brand. To users, the company provides owned and operated online properties and services (Yahoo! Properties, Offerings, or Owned and Operated sites). Yahoo! also extends its marketing platform and access to Internet users beyond Yahoo! Properties through its distribution network of third-party entities who have integrated its advertising offerings into their Websites or their other offerings. To advertisers and publishers, it provides a range of marketing solutions and tools that enable businesses to reach users who visit Yahoo! Properties and its affiliate sites. To developers, the Company provides an array of Web services and application programming interfaces (APIs), technical resources, tools, and channels to market.',NULL,'3900-12-21','Yahoo',0,NULL,NULL,NULL,NULL,'http://www.yahoo.com/',1994),(80523,NULL,'Zebu Compliance Solutions improves medical coding efficiency, reimbursement assurance, auditing toolsets, claim accuracy, and staff licensing/exclusion monitoring. Our clients reduce labor costs, increase revenue, and maintain audit-readiness. We have been a trusted partner in healthcare compliance since 1999. Our success is rooted in our staffs obsessive commitment to both total accuracy and intelligence in our systems, and simple, actionable results for our clients.',NULL,'3900-12-21','Zebu Compliance Solutions',0,NULL,NULL,NULL,NULL,'www.zebucompliance.com',1999),(80524,NULL,'Yelp connects people with boutiques, mechanics, restaurants, dentists and other businesses. The company’s local advertising services include a free online business account that enables businesses to view business trends, use the revenue estimator tool, message customers, update information, and offer Yelp deals and gift certificates.',NULL,'3900-12-21','Yelp',0,NULL,NULL,NULL,NULL,'http://www.yelp.com/',2004),(80525,NULL,'YourMapper allows users to freely visualize and map all of our data for the public, so communities can make sense of and share raw government data they otherwise would not have access to.',NULL,'3900-12-21','YourMapper',0,NULL,NULL,NULL,NULL,'http://www.yourmapper.com',2005),(80526,NULL,'Zillow is a home and real estate marketplace dedicated to helping homeowners, home buyers, sellers, renters, real estate agents, mortgage professionals, landlords and property managers find and share vital information about homes, real estate, mortgages and home improvement. Zillows mission is to empower consumers with information and tools to make smart decisions about homes, real estate and mortgages.',NULL,'3900-12-21','Zillow',0,NULL,NULL,NULL,NULL,'http://www.zillow.com/',2006),(80527,NULL,'ZocDoc is a service to help people find and make dentist appointments in New York City. Today ZocDoc is used by more than 4 million patients every month to book appointments with a wide range of medical specialties in 1,900+ cities and towns serving more than 40% of the US population.',NULL,'3900-12-21','ZocDoc',0,NULL,NULL,NULL,NULL,'http://www.zocdoc.com/',2007),(80528,NULL,'Zonability is a web application that provides economic development corporations an efficient way to identify and promote their community’s real estate assets. The product was named Zonability for giving people the “ability” to get fast access to important zoning rules.',NULL,'3900-12-21','Zonability',0,NULL,NULL,NULL,NULL,'http://www.zonability.com/',2003),(80529,NULL,'Zoner is a Digital Zoning Optimization software that delivers real estate feasibility fast with clarity. Regulation today is complex; Zoner removes uncertainty and improves the decision making process of real estate planning, and investment.\n \nIf you have a business and you want to know if the use is allowed on a site you wish to purchase or rent; Zoner will tell you.  If you are a home owner considering making an addition; Zoner will tell you how much you can build.  If you are a community board member and you want to communicate the set back relationships in a particular zone; Zoner will help you visualize what is possible. \n \nSince 2002 40% all available land in New York City has been rezoned.  These changes result in confusion and uncertainty for owners, businesses, and communities. Zoner delivers transparency so that your business, home, or group can know what is allowed and the rough envelope that you project should fit inside. The data behind Zoner initiates from government data created with multiple redundancies that insuring reliability of information.  Our method of deliver maps, transforms, and shapes land use data into a realizable building project that conforms to regulatory jurisdictions. \n ',NULL,'3900-12-21','Zoner',0,NULL,NULL,NULL,NULL,'www.Zonerapp.com',2011),(80530,NULL,'Zurich Risk Room helps corporate customers gain a structured insight into the complexities of global risk. It uses data on risks as varied as water shortages, energy price fluctuations, or political unrest. The tool goes beyond the ability to look at risks in single dimensions and shows the complex interactions between many different types of risks.',NULL,'3900-12-21','Zurich Insurance (Risk Room)',0,NULL,NULL,NULL,NULL,'http://www.zurichna.com/',1912);
